	(116, 108, 20, 'Tiger Foods Limited', 'tiger-foods-limited', NULL, NULL, '<p><br></p>', '+234-8033228313', 'info@tigerspices.com', NULL, NULL, _binary 0x000000000101000000E77A91BF6A2B1B408912E3EB21881840, 6.13294190, 6.79239940, NULL, 'Anambra', 'NG', '2019-02-15 22:33:41', NULL, NULL, NULL, '2019-02-15 05:33:45', '2019-08-19 07:53:35', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/27\\/8d44c5151d32cb38b9b6857d57184571.jpg"]', 'http://www.tigerfoods.com', '2019-02-17 08:47:05', 'KM 4, Onitsha-Owerri Road, Obosi Anambra State', '<p>For more than 2 decades, Tiger Foods has been active in the processing, distribution and marketing of spices, aromatic herbs, seasonings and dehydrated vegetables in Nigeria. </p><p><br></p><p>An independent family business with genuine business value, which services customers that cut across fast-food restaurants, noodles, pasta, bakery and catering industries as well as individual consumers.</p><p><br></p><p>Operating under complete GMP in 13,947 square meters production space, Tiger Foods with its special milling, blending and packing capabilities offers customers in-house special packaging, custom blending, partnership to new products development and marketing assistance.</p><p><br></p><p>Major products include Curry powder, Thyme leaves, Anise, Nutmeg, Clove, Cinnamon powder, Peppercorn, Fennel, Cardamom, Dill, Sweet basil leaves, Bay leaves, and specialty blends of spices & seasonings with a tinge of West African taste. MSG, Chicken seasoning, Beef, Fish, Tomato, Onion, Pepper-soup and Fried Rice seasonings are all part of the product line.</p><p><br></p><p>With successful backward integration and industrial aggregation, local law materials currently sourced in Nigeria include Ginger, Garlic, Ehuru (Calabash Nutmeg), Negro Pepper, Basil leaves, Curry Leaves, Turmeric, Black Pepper and Chilli Powder.</p><p>Dehydrated Vegetables like Carrot flakes, Onion flakes, Bell Pepper flakes, Potato cubes, Okra, and Tomato powder, Pumpkin Leaves, Cocoyam Flour, add excitement to the growing list of exciting locally processed products.</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/5113147ca70a45931584f3748f0b5ea4.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/a8564b13012468a8c63bf4f82f597716.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/f7bd2d95969d0060eadbdc3c20a25fda.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/ac985a603118d77de6832eb6184c463d.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/083b8a3e1974023023dd2a1b52e4b244.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/b7405027da2374b6d500012795fd8636.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/ac7f87765fa021ec7aec17efb00a6a2c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/1411bce36a3eb119289a8e937092d7b2.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/02\\/25\\/f59eaaa45dfbb348e6c1177987274ad0.jpg"]', 'https://afiaanyi.com/storage/brandlogos/5/6/7/0/116.jpg', 0, 1, NULL, NULL, 'https://afiaanyi.com/storage/brandvideo/5/2/a/f/116.mp4', 36),
	(119, 36, 4, 'Tiger Foods Limited', 'tiger-foods-limited', NULL, NULL, '<p>For more than 2 decades, Tiger Foods Limited has been very active in the distribution and marketing of Spices, Aromatic herbs, Seasonings, Dehydrated Vegetables, and Beverages in Nigeria and some West African countries. An independent family business with a genuine business value which serves a whole lot of customers that cut across fast food chains, noodles, pasta, bakery and catering industries as well as households.</p><p><br></p><p>Our major products include <strong>Curry Powder, Coriander Seeds, Thyme Leaves, Nutmeg Seeds and powder, Clove, Cinnamon Powder, Peppercorn, Dill seeds, Tomato paste, Rosemary Leaves, Sweet Basil Leaves, Tumeric Powder, Bay leaves, Ehuru Powder and specialty blends of spices and seasonings with a tinge of west African taste</strong>. Chicken, Beef, Fish, Tomato, Onion, Peppersoup, Fried Rice seasonings are all part of our product lines. Dehydrated Vegetables like Carrot Flakes, Onion Flakes, Bell Pepper Flakes, Potato Tubes, Minced Okra and Tomato Powder all add excitement to our growing list of exciting products.</p>', '+234-9030006400', 'customercare@tigerspices.com', NULL, NULL, NULL, 0.00000000, 0.00000000, NULL, 'Anambra', NULL, '2019-06-27 08:44:45', '2019-08-07 16:08:06', '["Beverages"]', 'Beverages', '2019-02-25 08:45:58', '2019-08-15 10:20:10', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/93634db4e4b05861a9a1ec3f642bdd87.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/401ff22fad00a45e4d41606093903077.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/302f3f3b41ac2217e8277a862ca604aa.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/7d140c53bb1a73590406859e33943a90.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/1bf2c877d4dd9d89475033b148eb2be3.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/a26f7c42193f3fc296c319aeff27682b.jpg