	(120, 36, 4, 'Rexton Industries Limited', 'rexton-industries-limited', NULL, NULL, '<p>Rexton Industries Ltd. is a wholly owned Nigerian company. We are manufacturer of high-quality blended alcoholic beverages and allied products under different brand names</p><p><br></p><p>For more than 20 years, Rexton Industries has satisfied appetites of people around the country with a variety of blended alcoholic drinks, and have added new portfolio of products to the consumer market. These products are high in quality, value driven and simply satisfying.</p>', '08030888286, 08033166272, 08098024111', 'info@rextonindustries.com', NULL, NULL, _binary 0x0000000001010000007862D68BA15C1B406E63586A62D61840, 6.20935980, 6.84046000, NULL, 'Anambra', 'NG', '2019-02-27 05:12:44', NULL, '["Beverages"]', 'Beverages', '2019-02-25 11:21:09', '2019-08-15 10:20:10', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/d1c81246768ee14462cb30ea71a0a514.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/24f3ef2e1fe43825940f4f70abd2126d.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/98ec16198fc4cc76627f90a832879a4c.jpg"]', 'www.rextonindustries.com', NULL, 'Address: 1 Castello Avenue, KM 3 Nkwelle-Ezunaka Express Way, Nkwelle, Anambra State, Nigeria.', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/7/6/2/7/120.jpg', 0, 1, NULL, NULL, NULL, 36),
	(121, 36, 20, 'Dozzy Group', 'dozzy-group', NULL, NULL, '<p>Dozzy Group is an indigenous conglomerate which started in 1982 as the vision of our Founder, Sir Daniel N. Chukwudozie, a hardworking, resilient and dynamic business mogul.</p><p><br></p><p>Our Founder’s vision commenced as a trading company, Dozzy Nigeria Limited, before expanding into every major sector of the economy, ranging from Oil and Gas to Manufacturing, Commerce/Logistics, Real Estate and Hospitality under the parent company, Dozzy Group.</p>', '+2348035741803', 'info@dozzygroup.com', NULL, NULL, _binary 0x000000000101000000E77A91BF6A2B1B408912E3EB21881840, 6.13294190, 6.79239940, NULL, 'Anambra', 'NG', '2019-02-27 04:53:50', NULL, '["Oil and Gas","Manufacturing","Marine"]', 'Oil and Gas,Manufacturing,Marine', '2019-02-25 12:34:49', '2019-08-15 10:20:10', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/a6dce58d87f4019188bb246c56343156.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/d43b6c3cfd5971255f0ac4a88d8e5fe3.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/25\\/3a303b1d3b810965c00ad029279cb0d9.jpg"]', 'www.dozzygroup.com', NULL, 'Plot 1N 10/12 Dozzy close Niger Bridge Industrial Layout, P.M.B 1591, Onitsha, Anambra State', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/f/0/4/5/121.jpg', 0, 1, NULL, NULL, NULL, 36),
