	(132, 16, 20, 'Ngobros & Company Nigeria Ltd', 'ngobros-company-nigeria-ltd', NULL, NULL, '<p>Babymate products are a collection of healthy, safe, pure and gentle baby care products which are specially produced for babies and their delicate skin. The products are made in Nigeria by Ngobros and Company Nigeria Limited out of the desire to have high quality but affordable baby care products proudly manufactured in our country.</p><p>Our company, with a fully modern computerizes system and well equipped modern laboratory uses the latest technology and the best raw materials to ensure that the quality of our products is in adherence with the local and international quality standards.</p><p>The Babymate disposable diapers come in two categories which are the Babymate premium diapers usually called Babymate and the Babymate Adorable diapers which is our economy brand. </p><p>Babymate diapers are affordable, convenient and eco-friendly. They are best in combating diaper rash because of its in-built protective barrier which keeps wetness at bay.</p><p><br></p><p><br></p>', '234(0)815 091 1694', 'info@babymateng.com', NULL, NULL, NULL, 0.00000000, 0.00000000, NULL, 'Anambra', 'Nigeria', '2019-04-28 12:26:51', NULL, NULL, NULL, '2019-04-27 20:23:52', '2019-08-15 10:20:11', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/04\\/29\\/132_8a0da517d35f6168321f4af290e2cfc8.jpg"]', 'http://www.babymateng.com', '2019-04-27 21:23:52', 'No. 71-78 Obidiah Road, Nnewichi-Nnewi', '<p>NGOBROS AND COMPANY NIGERIA LIMITED is a family owned business which started as a trading company in 1972 and became a Limited Liability Company in 1985. With an ethical business standard and practices, NGOBROS AND COMPANY NIGERIA LIMITED is today, graded as the best partner to customers, suppliers and employees.</p><p>NGOBROS AND COMPANY NIGERIA LIMITED is undoubtedly one of the leading auto spare parts, lubricants and daily care providers in Nigeria, serving a wide range of customers from various African countries, as well as the Nigerian local markets. NGOBROS strives hard to provide high quality products and excellent service to customers.</p><p><br></p><p>NGOBROS AND COMPANY NIGERIA LIMITED have earned an incredibly growth and a good reputation of being one of the most respected and dependable product brand in Nigeria. We have an advantage over many other companies through our experience and expertise which we have gained over the last three decades. We have over 1,000 people contact us every day for our products.</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/04\\/28\\/132_69bf96ab2c1a90c7501a236518b5fa8f.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/04\\/28\\/132_de3bb49421f38412e1e49a361ec4f66c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/04\\/28\\/132_05642b8dc744e43ca577682236dea135.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/04\\/28\\/132_307df9127b9fea353f863265fccc0f69.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/04\\/28\\/132_eef6be22118aebf95a148026d0723f64.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/04\\/28\\/132_3aa12e49550daaa20918fc394f507986.jpg"]', 'https://afiaanyi.com/storage/brandlogos/3/f/2/f/132.jpg', 0, 1, '<p>Makers of Babymate Diapers and range of other quality and affordable products</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/coverphotos\\/3\\/f\\/2\\/f\\/132.jpg"]', NULL, 16),
