	(164, 106, 20, 'Seahorse Lubricants Industries Ltd', 'seahorse-lubricants-industries-ltd', NULL, NULL, '<p><strong><br></strong></p>', '+2347065781609, +2349030008573', 'customercare@seahorselubricant.ng', NULL, NULL, _binary 0x000000000101000000D2A8C0C936101C40DF15C1FF56FA1540, 5.49447250, 7.01583400, NULL, 'Anambra', 'Nigeria', '2019-08-04 21:25:18', NULL, NULL, NULL, '2019-08-04 20:22:49', '2019-08-04 20:31:47', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/04\\/164_182493f05f768f6e1170e51048cb9966.jpg"]', 'http://www.seahorselubricant.ng', '2019-08-04 21:25:22', 'Km 24, Onitsha-Owerri Expressway,Ozubulu, Anambra State.', '<p><strong>SEAHORSE Lubricants Industries Ltd.</strong>, manufacturers of lubricating oil for internal combustion engines and mechanical systems, is situated in Ozubulu, Anambra State, South-East, Nigeria. With the approval of the Department of Petroleum Resources, it started operation in 2017. Our top management has enormous wealth of experience in lubricant business, having successfully managed many Lubricant Marketing Companies spanning over 20 years in West African countries and strong international business relationships with some of the world’s noted names in the petroleum industry. With this wealth of experience, this ultra-modern Lube Industry was set up in South-East, Nigeria</p>', '{"2":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/04\\/164_bd819a1671546c10ddc4834b472fba48.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/04\\/164_15db73b04215fa6d5a3ffe9a679a173b.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/04\\/164_7275fcfb7d6e4a9af4179df395473390.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/04\\/164_858f551d3771bfca5eed5b2d365ba73e.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/04\\/164_9fce98d2bcb6f14ca0b6b150dce1f37f.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/04\\/164_2b