	(166, 108, 20, 'Tiger Beverages Limited', 'tiger-foods-limited', NULL, NULL, '<p><br></p>', '+2349030006400', 'customercare@tigerspices.com', NULL, NULL, _binary 0x00000000010100000076C6527F182C1B40B863A021D2751840, 6.11505940, 6.79306220, NULL, 'Anambra', 'Nigeria', '2019-08-06 12:33:37', NULL, NULL, NULL, '2019-08-06 11:12:06', '2019-08-06 17:30:56', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/06\\/166_8dbcb15a01b9428db9e970ad1e71c019.jpg"]', 'https://www.tigerfoods.com/beverages/', '2019-08-06 12:35:59', 'KM 4, Onitsha-Owerri Road, Obosi Anambra State', '<p>In 2014, Tiger Foods Limited increased its investment portfolio by adding Beverages to its product lines. Currently, we have the following Beverages; <strong>Tiger Energy Drink, Bree Merlot Red Wine, D’Ángelus (Brut and Rose)aerated sparkling alcoholic wine, Tiger Ginger Health Drink, Tiger Karnival, and Angel Sparkling Health Drink (non-alcoholic wine)</strong>.</p><p>Tiger Foods Limited directly employs about 300 employees. This number excludes merchandisers and other indirect employees some of whom were seconded to product distributors, local vendors, and off-site processors.</p><p>Our vision is to achieve a minimum of 80% local content within the next 3 years.</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_7b984aa7d7f4402929c4dd7038067500.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_c091ad2acc968d3a65b819976ca015e2.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_d2d1b2a35c06e44a736c7d939f522ca7.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_b90d5b2e0ce618a9a233b238ee9f07e1.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_9019ec128be54e5cfa0538b58f41d904.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_efcfb9d536a695681e2e491dc0553647.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/166_c2b