	(167, 109, 20, 'SNF Food Ltd', 'golden-oil-ltd', NULL, NULL, '<p><span style="color: black;">Golden Oil Industries Limited is part of the Mirchandani group of companies, which has been in operation in West Africa for over 50 years with interest spanning breweries, plastics, trading, aquaculture and vegetable oil production. The group is well known for its integrity, professionalism, and commitment to world-class best practices across all the operations in which it is engaged. The company is considered a family company where many of its experienced staff of Nigerians and Indians have been part of the team for over 15 years. The continuity and determined will to improve is one of the key strengths of the company. With a 27 year history of continued innovation and best management practices, the company is primed to become one of the largest edible oil companies in West Africa in the coming years.</span></p><p><span style="color: black;">Golden Oil Industries Ltd., has got an excellent infrastructure in terms of production machinery and equipment. </span></p>', '09063956766, 09029999147', 'swamy@snfltd.com', NULL, NULL, _binary 0x000000000101000000D9709F6692121B40EE8A2A0D467E1840, 6.12331410, 6.76813660, NULL, 'Anambra', 'Nigeria', '2019-08-07 15:51:43', NULL, NULL, NULL, '2019-08-06 13:01:13', '2019-08-08 06:04:31', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/08\\/167_a9b58ba8ba517be7616c66f734d9d1e4.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/08\\/167_9f0e1e46a895c27284efc904fa55b191.jpg"}', 'https://www.activa.ng/', NULL, 'Plot No.51A Harbour Industrial Estate Off Atani Road, Pokobros Industrial Avenue, Onitsha, Anambra State, Nigeria', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/3/d/a/b/167.jpg', 0, 1, NULL, NULL, NULL, 57),
	(168, 110, 20, 'Chicason Group', 'chicason-group', NULL, NULL, '<p><br></p>', '012934767', 'info@chicasongroup.com', NULL, NULL, _binary 0x000000000101000000A9017D224F820B40487254C95BC91940, 6.44663920, 3.43862750, NULL, 'Anambra', 'Nigeria', '2019-08-06 15:35:54', NULL, NULL, NULL, '2019-08-06 14:32:58', '2019-08-06 14:38:29', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/06\\/168_adcbd872a70f9d8e622e4d74f202c4e6.jpg"]', 'http://chicasongroup.com', '2019-08-06 15:36:18', '21 Bourdillon Road, Ikoyi, Lagos', '<p class="ql-align-justify">Chicason Group is a home grown and technology driven conglomerate, with vibrant member companies and affiliated businesses that epitomize the African enterprise spirit with diverse interests.</p><p class="ql-align-justify">Chicason Group has over the past 36 years built its reputation on the foundation of integrity, commitment, team work and providing great value through great people culture. The Group has throughout the years grown into a strong player in its markets and has continued to demonstrate exceptional performance through excellent products and service delivery to our clientele and forming strategic trade relationships with highly reputable companies across the globe.</p><p class="ql-align-justify">Our brands include A-Z Petroleum Products Limited, Rock of Ages Properties PLC, RIMCO Mining, Cason Travels Limited, RIMCO Nigeria Limited, Afro-Asia Automobile & Plastics, Promotex Nigeria Limited, etc.</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/168_71b6fb13de82e4f64d9c8e06f1332cfd.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/168_ea9d5dee52770f8e5c5ee0d333cc1e5c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/168_7596cda89992555ef0180d6c66143aa8.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/168_8c6c33a9ebb46fbb7435de837daccac8.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/06\\/168