	(169, 57, 20, 'Tiger Bervearges Limited', 'tiger-bervearges-limited', NULL, NULL, '<p>In 2014, Tiger Foods Limited increased its investment portfolio by adding Beverages to its product lines. Currently, we have the following Beverages; <strong>Tiger Energy Drink, Bree Merlot Red Wine, D’Ángelus (Brut and Rose)aerated sparkling alcoholic wine, Tiger Ginger Health Drink, Tiger Karnival, and Angel Sparkling Health Drink (non-alcoholic wine)</strong>.</p><p>Tiger Foods Limited directly employs about 300 employees. This number excludes merchandisers and other indirect employees some of whom were seconded to product distributors, local vendors, and off-site processors.</p><p>Our vision is to achieve a minimum of 80% local content within the next 3 years.</p>', '09030006400', 'customercare@tigerspices.com', NULL, NULL, _binary 0x00000000010100000076C6527F182C1B40B863A021D2751840, 6.11505940, 6.79306220, NULL, 'Anambra', 'Nigeria', '2019-08-07 15:49:46', '2019-08-07 16:09:08', NULL, NULL, '2019-08-06 17:33:43', '2019-08-07 15:09:08', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/07\\/169_8dbcb15a01b9428db9e970ad1e71c019.jpg"]', 'https://www.tigerfoods.com/', NULL, 'KM 4, Onitsha-Owerri Road, Obosi Anambra State', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/5/5/2/4/169.jpg', 0, 1, NULL, NULL, NULL, 57),
	(170, 111, 38, 'SmartC - Zero Credit', 'smartc', NULL, NULL, '<p><strong>SMART C - ACCESS TO ZERO CREDIT</strong></p><p>All Calls from a SmartC Number to any other SmartC Numbers is absolutely FREE irrespective of the number of Hours.</p><p>Calls from SmartC Numbers to Non-SmartC number from any Network (AIRTEL, MTN, GLO or ETISALAT) costs 11kobo per second.</p><p>CALLS from SmartC User to all INTERNATIONAL LINES in U.S.A, Canada and U.K costs 10 naira per minute.</p><p>SMS from SmartC User to SmartC Users is absolutely FREE.</p><p>With SmartC plan you have access to Our Cheap Data plan (SMARTC DATA PACKAGE).</p>', '08065882250', 'treasurebase.h2i@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, 'FCT', NULL, '2019-08-07 15:49:24', NULL, NULL, NULL, '2019-08-07 07:33:50', '2019-08-07 14:49:28', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/07\\/170_27c0ad33396390061c8ebe027c2829e5.jpg"]', 'www.smartcnigeria.com/08065882250', NULL, 'Gwagwalada', NULL, NULL, NULL, 0, 0, NULL, NULL, NULL, 111),
	(171, 112, 33, 'Gemville Academy ,Kubwa Abuja', 'gemville-academy-kubwa-abuja', NULL, NULL, '<p>Gemville Academy provides creche ,Nursery and Primary school in a very condusive environment that seeks to discover the innate of the individual learner . The Gemville Academy  creche provides a safe and loving environment for babies from 03months - 18months whose mothers are busy and would need a place where they will have rest while attending to other needs .</p>', '0803 787 6641', NULL, NULL, NULL, NULL, 0.00000000, 0.00000000, NULL, 'Anambra', NULL, '2019-08-07 15:49:02', NULL, NULL, NULL, '2019-08-07 11:27:19', '2019-08-12 18:07:44', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_bb61a693f3f7aaf64a8bb0cdff113e71.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_61423410bc7f81facaf2dbcf34c55d0e.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_f35ef3d9be314ca76e7010529783507e.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_374c41be819fe7a1ed11ffd9d4c74d9a.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_ab0c4b3ba76c8f2eaef8431619908e59.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_11928abb1bd1f4d8f58fdad915838dd2.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_0a1e6e2ee4531f199c1c8735d522403f.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_74983635f133fbe945bb59382665a83c.jpg","9":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_8035175a1ef92cf5c3031d82d608325e.jpg","11":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_5b04a715060c17171f9adba75c4574ca.jpg","12":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_8fa5388ecfe320ac8ae51f8a2a1c1b3c.jpg","10":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/12\\/171_e236c7f368b90406358f1de98fff43fd.jpg","15":"https:\\/\\/afiaanyi.