	(172, 113, 39, 'GLIMPSE LAUNDRY AND DRY CLEANING SERVICES', 'glimpse-laundry-and-dry-cleaning-services', NULL, NULL, '<p>House of Glimpse is a laundry and dry cleaning services establishment registered in Nigeria with the Corporate Affairs Commission. Our office is situated in Awka, Anambra State. We offer exceptional laundry and dry cleaning services to our customers. We are synonymous with speed and promptness as far as laundry services is concerned. We are admired by our clients for these two qualities. Our services range from washing, starching, ironing, removal of stubborn stains on fabrics and general dry cleaning services. We add fragrance to the fabrics of our customers after dry cleaning which gives them refreshing scent. We also offer home pick up and delivery services to most of our customers who resides far from our office but have been impressed by the way we offer our services, and those who don\'t have the luxury of time to bring their clothings to our office or pick them up. We also have pick up centers strategically spreaded across Awka for service proximity.</p>', '08039397367', 'glimpselaundry@gmail.com', NULL, NULL, _binary 0x0000000001010000006000005C4393683FABBFFA7FC3524E3F, 0.00092539, 0.00299991, NULL, 'Anambra', NULL, '2019-08-07 15:48:35', NULL, NULL, NULL, '2019-08-07 12:09:09', '2019-08-07 14:48:35', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/07\\/172_e1b9d014b8c7cc0ad7760dbc193c2d64.jpg"]', NULL, NULL, 'Ifite Awka, Anambra State, Nigeria', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/9/f/6/9/172.jpg', 0, 1, NULL, NULL, NULL, 113),
