	(174, 116, 20, 'Envoy Oil Industries Ltd', 'envoy-oil-industries-ltd', NULL, NULL, '<p><br></p>', '07030762099, 07034140825', 'envoil@yahoo.com', NULL, NULL, _binary 0x000000000101000000CCFF972144201B406DB477A114801840, 6.12507870, 6.78150990, NULL, 'Anambra', 'Nigeria', '2019-08-07 15:24:08', NULL, NULL, NULL, '2019-08-07 14:21:02', '2019-08-12 08:06:35', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/07\\/174_69a70a5eb5b551f0b264b77ab792c21e.jpg"]', 'https://www.envoyindustries.com/', '2019-08-07 15:24:17', 'Envoy Oil Industries Ltd. No. 2 Eziachi Street / 53 Obodoukwu Road off Atani Road, Onitsha Anambra State Nigeria', '<p>Envoy Group is an indigenous company that is a major player in the commerce activities in Nigeria and the West African Sub Region. Part of this Group is Envoy Oil Industries Ltd, which is a Limited Liability Company incorporated in Nigeria and registered with the Corporate Affairs Commission with RC No. 332105. It was established in March 1998 and being a conglomerate, it is divided into food industries, chemical industries, Bureau De Change, Transport and Logistics, Import &amp; Export thus ENVOY GROUP.</p><p><br></p><p>The food industries are involved in the production, extraction and processing of varied range of vegetable oil products, while the Chemical industry sectors are involved in the production of cosmetic products such as soap.</p>', '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/07\\/174_268b96f5252818898cd674f57059ccf5.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/07\\/174_8bc506e2a476edca54116e9ebd8d175b.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/07\\/174_f7c8019980a1a06ab67a32ed86f05dc7.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/07\\/174_816a72c9423a19e6785c288666abbe12.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/07\\/174_00a7c059a0c48e880246d19cd88d8d98.jpg","5":"https:\\/\\/afia