mages\\/2019\\/08\\/23\\/176_707741cb3697c7d1ee9c78d3f619cd88.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/23\\/176_6a084d2289438b8375c5ab4918960e7a.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/23\\/176_145bf036a7e4d031416a2a70072e85fb.jpg"]', 'https://www.judeagbalaholdings.com', '2019-08-23 20:03:39', '152 Aba-Owerri Road, Abia State', '<p>With a trading history going back to the 1930s, <strong>J. Udeagbala Holdings </strong>is one of the oldest trading and manufacturing businesses in South Eastern Nigeria.</p><p><br></p><p>In 1992, we had grown to become a major conglomerate with several distinct subsidiaries.</p><p> </p><p>Under the distinctive and focused leadership of Ide John C. Udeagbala, our group is recognised as a leader in the <strong>manufacture and marketing of FCMG and industrial goods</strong> in Nigeria.</p><p>​</p><p>Our factories in Aba, Nigeria produce skin care brands, edible oils and multipurpose soaps for home and industrial use. </p><p>​</p><p><br></p>', '["https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_006d36591abc94912f0e39a96930cf41.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_76dc6ddfc0115c4447f34721449930d8.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_9cb964b77f949151da5556251e5be234.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_e810c5f8bdf6da266c22d4896a3afbcf.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_7a77c5d8d250e3e3696d845789adb4eb.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_f912d30241314120fc5c65d44a59397d.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_1c953a34584fbdcc039912b43aab373e.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_b43795800e39dad88c14040347541362.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_4a387e311c916f38503beeeb3c2aac60.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_64405817eeb51c04653213e487b36248.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_fe9a85f5b30d42722950fa1efeae8e11.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_1de2cdec2a0a588c3ddc18ed75cc9d6f.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_955d5e8e3e4a1df5935c8f2e227f5d96.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_43313f478ae38a42fba73dddc8591f06.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_8b223f800f09062a09a5f88d9f39bba8.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_e1e0b0c2be666a3745a3912c4a01b8f1.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/23\\/176_82db903d903321b52840e612674cb989.jpg"]', 'https://afiaanyi.com/storage/brandlogos/5/2/a/f/176.jpg', 0, 1, '<p>Our <strong>international affiliations at all levels</strong> provide us access to the latest manufacturing technologies and marketing strategies. These affiliations and partnerships have made it possible to present to Nigerians such brands as Tura.</p><p>​</p><p>We remain committed to making excellent brands and doing so under a green banner.</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/coverphotos\\/5\\/2\\/a\\/f\\/176.jpg"]', NULL, 57),
