erations in January 1997, with&nbsp;Corporate Office moved to No. 80 Limca Road, Nkpor Onitsha Anambra State in 1998. In 1998, Paxson was appointed Procter &amp; Gamble distributor for three states-Anambra, Imo &amp; Delta States. By October 2002, the whole of south east operations were ceded to Paxson. Today, Paxson is covering eleven (11) states- Anambra, Imo, Delta, Enugu, Abia, Ebonyi, Rivers, Bayelsa, Cross- River, Akwa-Ibom &amp; Benue.</p><p><br></p><p><strong>OUR VISION</strong></p><p>To build superior distribution performance in distributive trade through creative, dynamic and innovative actions</p><p><br></p><p><strong>OUR MISSION</strong></p><p>We will build a reputable distribution company by offering smart and unique services to our customers</p>', '["https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_89b79448a6a9537a2bf0f44b57647647.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_b61b128de187acb384fcc70b28363c4b.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_a782b7a9da28c51633a0fef68493a729.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_95746f16963c78f16a91533bd2fa982b.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_9f438b77a3a84f81c6227d42afb8b1d8.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_06139cd902dfce122138b24fc9f1ea27.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_9d349be4fa6b5d13be137c9a75a5e2a9.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_4203ecfcf8e2e1da8d176748bbe24cd6.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_f985e7754a4ed045a7794086a6e3e394.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_8e2109a8e0ae2fcb09e2dc78604bd8f3.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_14498deb09e4a8c2a0b90d8bf89712e4.jpg","https:\\/\\/afiaanyi.com\\