\/198_5c9558b3b4eb1418d1c6ce325467eb44.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_f8c3baef23f48b3244bac5419241977c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/galleries\\/2019\\/08\\/21\\/198_09e49d55916d4cf442872ef2d577f349.jpg"]', 'https://afiaanyi.com/storage/brandlogos/7/2/b/f/198.jpg', 0, 1, '<p><strong>KNORR</strong></p><p>Knorr’s range includes soups, bouillon cubes and stock pots, meal makers, sauces, seasonings and snacks that are designed to bring flavour to dishes using short cuts that people feel good about.</p><p>&nbsp;</p><p><strong>LIFEBUOY</strong></p><p>Since its launch in England in 1895, Lifebuoy has evolved to become the world’s best-selling, trusted germ-protection soap. Lifebuoy aims to bring better hygiene to communities all over the world. The brand actively promotes hygiene awareness by supporting Global Handwashing Day, and through their ‘Help A Child Reach 5’ and ‘School of Five’ campaigns. Lifebuoy has reached over 337 million people globally with its life-saving message about the importance of proper handwashing.</p><p>&nbsp;</p><p><strong>OMO</strong></p><p>OMO was first registered in the United Kingdom in 1908 and launched in Kenya in 1953 making it the oldest laundry powder brand in the country. The acronym OMO which is a household name stands for “Old Mother Owl”.</p><p>&nbsp;</p><p><strong>ROYCO</strong></p><p>Royco is a food additive that has been in the market for almost three decades and has been a true partner in the kitchen – transforming ordinary meals into finger licking ones.</p><p>&nbsp;</p><p>VASELINE</p><p>At any age, at any time, no matter what your skin need, the Vaseline skin care team wants everybody to be able to enjoy great, healthy skin every day.</p><p>&nbsp;</p><p>SUNLIGHT</p><p>Did you know that Sunlight was the world’s first packaged, branded laundry soap, originally produced by the Lever Brothers in 1884?</p>', NULL, NULL, 57),
