	(203, 149, 86, 'DEES TRAVELS AND TOURS LIMITED', 'dees-travels-and-tours-limited', NULL, NULL, '<p><strong>TICKET SALES</strong></p><p>Dees Travels &amp; Tours Limited holds electronic tickets of all airlines be it local, Regional or International. We have been able to expand ticket stock holding to meet client\'s requirements with the introduction of BSP (Billing and Settlement Plan) in our markets</p><p><br></p><p><strong>VISA SERVICES</strong></p><p>As a result of changes in consular rules discouraging applicant for entry visa by proxy and creation of Virtual File System (VFS) centers, we provide advisory services on how to secure visas.</p><p><br></p><p><strong>AIRPORT PROTOCOL SERVICES</strong></p><p>We arrange first class airport protocol for both departure and arrival passengers at a cost to be mutually agreed upon. We assist with check-in formalities and luggage transfer. </p>', '08033484517', 'info@deestravelnigeria.com', NULL, NULL, _binary 0x00000000010100000004882760E00E0B404D1BC4BDE8D11940, 6.45498940, 3.38226390, NULL, 'Lagos', 'Nigeria', '2019-08-29 13:41:32', NULL, NULL, NULL, '2019-08-29 12:32:04', '2019-08-29 12:41:32', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/203_c4956a6e26c55bb390495bdc21251cee.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/203_34e0474d1ce9430d312ce6f992e58276.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/203_a0e02fcf09a6abdb20beadbb214e9a58.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/203_be7e9d977ee6358e1af4be5fb1171fd8.jpg"]', 'https://deestravelnigeria.com', NULL, '182/184 Broadstreet, 1st floor, Wilberforce House, Opposite Ecobank by Apongbon bridge, Lagos.', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/e/a/9/f/203.jpg', 0, 0, NULL, NULL, NULL, 57),
	(204, 150, 100, 'Toprano Hotel', 'toprano-hotel', NULL, NULL, '<p>Toprano Hotel is a leading contemporary leisure/ business-class hotel located within the accessible area of Ikeja and prides itsself with modern accommodation facilities that makes every guest feel satisfied. Ikeja Airport is merely 13 minutes from the Toprano Hotel. The rooms are clean and affordable. Unlimited and 24/7 Wifi.</p><p>At Toprano Hotel, we are dedicated to perfecting the travel experience of our guests. Our highly personalized 24-hour service, combined with authentic, elegant surroundings of the highest quality, embodies a home away from home for those who know and appreciate the best. Guests staying at Toprano Hotel in Ikeja Lagos Nigeria can expect first-rate standards of service and quality while enjoying convenient access to the city’s best leisure attractions and business destinations.</p>', '07016000050', 'booking@topranohotel.com', NULL, NULL, _binary 0x0000000001010000009FD3264EEE970A40B24AE9995EAA1A40, 6.66637650, 3.32418500, NULL, 'Lagos', 'Nigeria', '2019-08-29 13:52:21', NULL, NULL, NULL, '2019-08-29 12:47:45', '2019-08-29 13:14:15', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_fcf659a200c76514b1dc0745a4558c64.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_06338023de336b06883f7f1cddaf00a8.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_987ce390bd9aa7be7746e63eb8f547f6.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_d4a08fff5db0426b5204b0c461ae84d4.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_fbcdad8fd07b60d71cd86c350344752b.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_a6dad881beea005003ccd071b99a5688.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/204_10bf0a77e1b0bd0e8295917e7e6cd623.jpg"]', 'https://topranohotel.com', NULL, '42, Oritshe Street, Off Balogun Bus Stop Awolowo Way Ikeja, Lagos', N