	(205, 151, 100, 'THE GRAND MIRAGE HOTEL', 'the-grand-mirage-hotel', NULL, NULL, '<p>At The Grand Mirage Hotel you will find consistent and high standards of service and accommodation whenever and wherever you stay. The Grand Mirage Hotel also endeavors to bring you best-in-class reservation service. Whether your booking preference is online or over the phone with one of our worldwide call centers, The Grand Mirage Hotel works to bring you the easiest, most effective methods of booking.</p>', '092916761', 'grandmiragehotelgarki@gmail.com', NULL, NULL, _binary 0x000000000101000000CCF04174AD021E40151DC9E53F142240, 9.03955000, 7.50261480, NULL, 'FCT', 'Nigeria', '2019-08-29 14:28:30', NULL, NULL, NULL, '2019-08-29 13:23:15', '2019-08-29 13:28:30', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_4d5cf9977acbb106148b4f6b1705e996.jpg","13":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_3b55a7c4801fe176c5dc72e438664acf.jpg","14":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_c8f499d4f3477c46c5f420ae90cbb2cb.jpg","15":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_c19e5e4725c4c6efb3d2220b66619ed1.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_9087e413a6b7ac3a70d05a517bc5ce8f.jpg","17":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_93f5897bcb0569d12975232f5dfdfcd0.jpg","16":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_fc9aaa7373c7f1f339df6cfcd7c4c82b.jpg","18":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_405bb37b2299123118b7e60b6be2bc96.jpg","19":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_4d5cf9977acbb106148b4f6b1705e996.jpg","20":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_b086f4fe0ee2b24ca8bbd69db30daabe.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/205_8befe466e2205c1ffd5f5c542c528752.jpg"}', 'http://www.gran