	(206, 153, 100, 'Greatwood Hotel Limited', 'greatwood-hotel-limited', NULL, NULL, '<p>We are a team of expert Hoteliers with the aim of providing quality top notch hotel services. <strong>We spare no expense when it comes to providing our customers the best services.</strong> With our very 1st Hotel in Owerri we plan on expanding our services to other parts of Nigeria and beyond.Our brand stands for Comfort and quality services. We came into existence in October 2015 with a Management team with years of experience.</p><p>We intend to build on this to expand and extend our services to every realm of hospitality and tourism.</p><p>We are a force to rekon with in the hospitality industry and will remain that way in a very long time to come. Facilities Available </p><ol><li><strong>Conference Hall</strong></li><li><strong>Guest Activities and Amenities</strong></li><li><strong>Banquet Hall</strong></li><li><strong>Luxury Guest Rooms</strong></li></ol><p><br></p><p><br></p>', '09020103352,  08063927500, 09095596130', 'info@greatwoodhotels.com', NULL, NULL, _binary 0x000000000101000000DC076A42A4001C407DAEB6627FD91540, 5.46240000, 7.00062660, NULL, 'Imo', 'Nigeria', '2019-08-29 14:59:29', NULL, NULL, NULL, '2019-08-29 13:44:29', '2019-08-29 13:59:29', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/206_207f0deba2e80d2bb4d51fd4d2910aaa.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/206_b12315bdd0dbc3325f15f2abbdb1755e.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/206_8b2902e74f4e09fb2a694c4531430cd9.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/206_576876e9ead2d08b285eac85e3e73d9e.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/206_f5806a7a38b0bb332104e24addfe56b8.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/206_92a64d1b3628e5254adf4d6dbba67f48.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\