	(207, 154, 86, 'Aeroport Travels and Tours Ltd', 'aeroport-travels-and-tours-ltd', NULL, NULL, '<p>Aeroport Travels and Tours Ltd is a full fledged travel management company located in Lagos, Nigeria. At ATTL, we strive to provide our customers with the very best service in the industry today.</p><p>We are committed to offering travel services of the highest quality, combining our energy, enthusiasm and years of vast experiences. Our greatest satisfaction comes in serving large numbers of satisfied clients who have experienced the joys and inspiration of travel.</p><p><br></p>', '09026856583', 'info@aeroporttravels.com', NULL, NULL, _binary 0x000000000101000000E93A9EE0ACA20A40BB6477DC4B351A40, 6.55204720, 3.32943130, NULL, 'Lagos', 'Nigeria', '2019-08-29 15:36:34', NULL, NULL, NULL, '2019-08-29 14:32:27', '2019-08-29 14:36:34', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/207_cc0695dda02ea5ac09a87847c9a0c036.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/207_16941515da2bd2757143680dc63b1687.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/207_3b24ced5bdbf20586b4f3f959ff9e989.jpg"}', 'https://www.aeroporttravels.com', NULL, '3rd Floor, 41 Osolo Way by 7&8 B/Stop, Airport Road, Ajao Estate Oshodi-Isolo, Lagos', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/9/4/2/6/207.jpg', 0, 1, NULL, NULL, NULL, 57),
	(208, 155, 86, 'Tifa Travels and Tours Limited', 'tifa-travels-and-tours-limited', NULL, NULL, '<p class="ql-align-justify">We bring the best attraction and experience in most destination around the globe to you at the lowest cost. We leverage on partners discount advantage to secure suitable and affordable accommodation for your vacations around the world.</p><p class="ql-align-justify">Wouldn\'t you rather travel with us.</p><p class="ql-align-justify"> </p><p class="ql-align-justify"> TIFA Travels & Tours Limited, an accredited IATA agent was established in 1990. We are fully registered in Nigeria. TIFA Travels & Tours Limited is one of the leading agencies both local and international route in Nigeria. Having established excellent and cordial relationship with all airlines, TIFA Travels and Tours Limited has become reputed for its high-tech detailed flight information, diligence and prompt service delivery.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">TIFA Travels &Tours Limited has arranged and successfully accomplished several tours to Japan, United States, United Kingdom, Belgium, and other parts of Europe. Our team of young, dynamic professional is among the best in the business.</p><p><br></p>', '08023537231, 08025729542', 'info@tifatravels.com', NULL, NULL, _binary 0x000000000101000000E43E83972AB20A40E99E758D966B1A40, 6.60506650, 3.33699530, NULL, 'Lagos', 'Nigeria', '2019-08-29 15:46:32', NULL, NULL, NULL, '2019-08-29 14:39:58', '2019-08-29 14:46:32', NULL, '{"2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/208_f5fb94bcd970fb0dac9d45ee0332c4c8.jpg","0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/208_7122265f35b858b210990bfb37e485cd.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/208_ad5645e3aa79548d1619896ba25278bb.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/208_c8eb1134ca6bc80d42c827d5d391e0b4.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/208_bae7f28b11a816b5ab9d6994ccd3c593.jpg"}', 'https://tifatravels.com/', NULL, '31 Oba Akran Avenue, 100282 Ikeja, Lagos State', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/c/0/8/c/208.jpg', 0, 1, NULL, NULL, NULL, 57),
	(209, 156, 86, 'Royalties Leisures and Tours', 'royalties-leisures-and-tours', NULL, NULL, '<p>It’s not always fun finding flight times and prices to suit your budget and schedule, but royalties Travels makes it fun with easy clicking. Let the fun begin and book a flight with ease.</p>', '07069609402', 'travels@royaltiestours.com', NULL, NULL, _binary 0x000000000101000000FAFA100A00D40A4043EAD1AF08691A40, 6.60257220, 3.35351570, NULL, 'Lagos', 'Nigeria', '2019-08-29 15:57:41', NULL, NULL, NULL, '2019-08-29 14:49:49', '2019-08-29 14:57:41', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/209_28e11f2a2c2b7c438a7abee4cb50d5ee.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/209_076eead5fdc36f07569dabb144f84222.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/209_b269f521b9f9731d578e3f0d75189d2d.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/209_dd4486035fc1e7720241469980207260.jpg"]', 'https://www.royaltiestours.com/', NULL, '1a, Akin Osiyemi street, Off Allen Avenue, Ikeja, Lagos', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/c/e/3/c/209.jpg', 0, 1, NULL, NULL, NULL, 57),
	(210, 157, 100, 'Avoire Voltic Nigeria', 'avoire-voltic-nigeria', NULL, NULL, '<h2>Overview</h2><p>Avoire Voltic is a creative branding firm specialized in Guest room amenities, Guest beddings, Towels, Bathrobes & Slippers, Cleaning Products, Corporate and Promotional items.</p><p><br></p><h2>Vision</h2><p>To be the leading name in Hotel support services, Brand innovation, Marketing communications.</p><p><br></p><h2>Mission</h2><p>To build long term relationships with our clients and provide exceptional customer services by pursuing business through innovation and commitment.</p><p><br></p><h2>Key Values</h2><p>The key to our process is indepth upfront research that we use to access internal and external perspective on organization to translate a huge creative approach.</p><p>We have a mix of professionals with wide range expertise. A typical brand engagement to a true team effort where our team collaborate closely with yours to discern your organization’s true strength and present them to the market place.</p>', '09090167733, 08033731320, 08136461418', 'avoirevoltic@yahoo.com', NULL, NULL, _binary 0x000000000101000000E8FE452B526C0A40A4FE7A8505E71940, 6.47560700, 3.30289110, NULL, 'Lagos', 'Nigeria', '2019-08-29 16:23:28', NULL, NULL, NULL, '2019-08-29 15:19:45', '2019-08-29 15:23:28', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/210_9da1c42600235fd3225d1a7f2a9647fe.jpg","0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/210_3d0b29e02f102dae958ec215ee775f5d.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/210_6c3b8d3055a1c29664d3138bbc006be7.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/210_c65385a675cb6e1f4bda2a3a94cf7955.jpg"}', 'http://www.avoirevolticnig.com/', NULL, 'Plot 1492, First Estate Off Raji Rasaki Road, Amuwo Odofin, Lagos.', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/a/f/7/1/210.jpg', 0, 1, NULL, NULL, NULL, 57),
	(211, 158, 100, 'DCM Hotel & Suites', 'dcm-hotel-suites', NULL, NULL, '<p>The DCM HOTEL & SUITES in Akowonjo, Egbeda, is a boutique hotel experience with Wine Country charm. Located just one 15 minuntes from the Air port, 10 minutes to the Financial District of Alimosho, the hotel is nestled in the district of Alimosho, the hotel offers an elegant European-style experience. Celebrating the nearby wine country in its design and hospitality." </p><p><br></p><p>DCM Hotel & Suites is on a quiet pedestrian street in the very heart of Akowonjo on the business district of Alimosho, DCM Hotel & Suites is the perfect place for your stay.</p><p>DCM Hotel & Suites is a 5 minute drive from the Airport (MMA2). Your walk around takes you through the stunning Places in Akowonjo, two iconic sites in the City.</p>', '+234 906 000 6086 , +234 906 000 3014', 'frontdesk@dcmhotels-suites.com', NULL, NULL, _binary 0x000000000101000000B1A2AB19BE6A0A405DDF878384681A40, 6.60206800, 3.30212040, NULL, 'Anambra', 'Nigeria', '2019-08-29 18:33:03', NULL, NULL, NULL, '2019-08-29 17:22:19', '2019-08-29 17:33:03', NULL, '{"5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/211_8c6fec9f6fe780f695166a51cddfd565.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/211_ef4e6641fdc216f55798dfe999d9b387.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/211_f5fe3e088af4b713ac5cde5cb1aaf844.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/211_b512754efa4a09051889d6c38a067044.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/211_2b07b7fcd3ed2274e7409a66dc8deece.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/211_176cecf28d16e8b3e23b33b230d1e7bb.jpg"}', 'https://www.dcmhotels-suites.com', NULL, '15, Oke Street off Shobo bus stop, Akowonjo road, Egbeda, Lagos', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/f/5/f/4/211.jpg', 0, 1, NULL, NULL, NULL, 57),
	(212, 159, 100, 'Cotton Suites', 'cotton-suites', NULL, NULL, '<p>Cotton Suites is a luxurious boutique hotel strategically located in a choice area in Victoria Island, Lagos State-the commercial hub of Nigeria’s business landscape. Its vantage position gives it the unique benefit of being able to offer its guests the twin advantage of serene and tranquil atmosphere in addition to close proximity to the busy Lagos metropolis and its other attractions.</p><p>The hotel is less than five minutes away from the business headquarters of various local and international companies and conglomerates, scenic natural beaches, shopping malls, myriad of world class restaurants (including the 411 Restaurant & Bar located within the hotel’s premises), night clubs, boat and marina clubs, the national museum, beautiful parks, and other attractive land marks.</p><p>We have created an environment of impeccable style and sheer luxury. Whether you are in town for business or pleasure, we have a special experience just for you.</p>', '07045977549', 'info@cottonsuites.com', NULL, NULL, _binary 0x00000000010100000095515F96766A0B40F2704C6084BA1940, 6.43214560, 3.42698400, NULL, 'Anambra', 'Nigeria', '2019-08-29 18:54:16', NULL, NULL, NULL, '2019-08-29 17:47:04', '2019-08-29 17:54:16', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_51c8a4acf148f9f003e322467caf403a.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_a2c69ec77a5e66e3b4f9dc806b33adb1.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_6b829c8a78b97c32aa78e0c96a7ee5bc.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_bdb0c61862f2d8993891e77195006c46.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_a8bbb29cdf615db1325ee52e423462da.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_e8ab8f4eeed25118484970103cc15088.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/212_3754d7b