	(213, 160, 100, 'Grand Capital Hotel', 'grand-capital-hotel', NULL, NULL, '<p>Grand Capital Hotel is a 3 star hotel situated in the heart of Ikoyi Lagos State and Alagbaka, Akure, Ondo State. We aim to offer you comfortable surroundings and rooms, great food and excellent service to make your stay truly enjoyable.</p><p>Please take a look through our web site where you will find most of the information you need. Call us to discuss your hotel reservation, dining plans or function requirements.</p><p>We look forward to welcoming you soon.</p><p>Our 3 star hotel and suites offers the best desired comfort and hospitality that you may require in your business or leisure visit to Lagos State and Ondo State capital and its environs.</p>', '08127609888', 'grandcapitalhotel@gmail.com', NULL, NULL, _binary 0x000000000101000000FCC808032ADF1440B68C8AEE0F021D40, 7.25201390, 5.21793370, NULL, 'Ondo', 'Nigeria', '2019-08-29 19:11:30', NULL, NULL, NULL, '2019-08-29 18:06:51', '2019-08-29 18:11:30', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_e032ac63c275d25db0b3412971cf346a.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_9af29e0adc6f05eb85b8e6077d170aae.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_e8eec073e15acbcf6e87e230390f6135.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_973856a58f3dda53f7078455e1627c09.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_277166d655cf1a67998012a64b166e0b.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_751ceb3c0b27f5e8030bf5735fb0ecb6.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_6dcb3a28b6b4fe9856064075eb69246c.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_8b2d1cd8e43e485e92298fc3b2592586.jpg","9":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/29\\/213_8a54c31433996ccd4cb0e52ed11c7f98.jpg","10