	(214, 161, 100, 'Royal Park International Hotel', 'royal-park-international-hotel', NULL, NULL, '<p>Bliss away from the city, to experience our upscale resort nestled in the midst of tranquility and great natural beauty. Whenever you need a quiet break from the bustling city life, head to the Royal Park International Hotel & Resort to experience one of the most breathtaking resorts in Nigeria that exudes the essence of privacy, culture and rejuvenation surrounded by picturesque hills and mountains in a safe, serene and peaceful environment. </p><p><br></p><p>This lovely resort features 89 rooms located among beautiful hills and mountain views, and four well technologically equipped conference rooms that can accommodate 80 to 1200 people for your corporate meetings and unforgettable social events. </p><p><br></p><p>You are only a short distance from the famous Olumirin Waterfalls, Ilerin Falls, Erin Ijesa and Ayikunnugba Waterfalls, the famous Ibodi Monkey Forest, and Oke Ila-Orangun.</p><p>Within 30 minutes from the resort, you will find yourself at the center of the ancient history of Ile- Ife. </p>', '+2348156046230, +2348081822222, +2348077888484', 'marketing@royalparkng.com', NULL, NULL, _binary 0x000000000101000000336FD575A846134087C5A86BED9D1E40, 7.65422600, 4.81900200, NULL, 'Osun', 'Nigeria', '2019-08-30 11:32:13', NULL, NULL, NULL, '2019-08-30 10:20:31', '2019-08-30 11:27:02', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/214_7cd4815ce8117b4817fdd9773d16e253.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/214_1cd91f9f8135e5ce6b6f11ddfe28ed58.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/214_246b256c2d8ae042c9a4e274b409e682.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/214_b09b7ce93d83be34df929ec857f1b55a.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/214_720beafc7aecd025bcedcecd8a8016d1.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\