	(215, 162, 100, 'FAWZY HOTELS LTD', 'fawzy-hotels-ltd', NULL, NULL, '<p>The hospitality industry welcomes a new classy hotel that strives to provide you with an awesome and refreshing experience. We have very clean and spacious rooms coupled with excellent services, courteous staff and a cosy ambience. Fawzy is located on Ring Road, the most popular high street and commercial nerve centre of Ibadan. It is only 300 metres from the main road and strategically tucked in a safe and serene environment.</p><p>We are a unique new entrant in the hospitality business with a vision to occupy a pride of place and be a force to reckon with in the industry within the shortest period of time. We have personnel whose experience in the hospitality business, spans more than a decade. It is our ultimate aim to offer exclusive services to you, so that your stay will be comfortable beyond your imaginations. Welcome to Fawzy Hotel!</p>', '+234 8105 4799 34, +234 9098 8467 50', 'info@fawzyhotels.com', NULL, NULL, _binary 0x000000000101000000AC58576023E40E405D9088844A771D40, 7.36649520, 3.86139560, NULL, 'Oyo', 'Nigeria', '2019-08-30 12:26:09', NULL, NULL, NULL, '2019-08-30 10:50:55', '2019-08-30 12:12:16', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_9160519824f8d707cb3378d577b46c5e.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_a9396a4e113f1ae2a68650f25ad10854.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_b495e927678e6e488c86ec38551fdc0f.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_6ebae3fdf1173a61ba5ed14bc32fc53c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_ac1a2dd73333204cfb640d87de5bd62c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_567b7cc0a1e3a05dbbb8a09120b220e2.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/215_afbe14baebd3b2d32d102bdf81493b66.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\