	(216, 163, 100, 'Ishakool Hotels', 'ishakool-hotels', NULL, NULL, '<p>Since 1980</p><p>We have been making our clients and customers happy with our unique approach to service delivery. Ishakool is located in a peaceful and secured environment both in Kaduna and Abuja with excellent staff eager to make your stay worthwhile.</p><p><strong><em>We make every stay at Ishakool hotels unique hence our slogan: The Quiet Wonder of Cool Hospitality.</em></strong></p><p><br></p><p><strong>Our Vision</strong></p><p>Our vision is to create a top class establishment which is focused around our customers.</p><p><br></p><p><strong>Our Mission</strong></p><p>Our mission is to supersede our customers expectation and to continuously improve our service delivery.</p><p><br></p><p><strong>Our Customers</strong></p><p>We strive to create a superb standard and atmosphere for hospitality and customer care.</p><p><br></p><p><strong>Our Staff</strong></p><p>We challenge every individual to strive for excellence through high performance for benefits of our guest</p>', '+234 903 303 9592', 'abujabookings@ishakoolhotels.com', NULL, NULL, _binary 0x000000000101000000F02CE68CCDFB1D4053A5773B0C0B2240, 9.02157770, 7.49590130, NULL, 'FCT', 'Nigeria', '2019-08-30 12:59:45', NULL, NULL, NULL, '2019-08-30 11:44:24', '2019-08-30 11:59:45', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/216_efd1e75c7182bdd1a04b6a008f1758b9.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/216_eb9c1a75e7b084366eb96b67bad361b7.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/216_aa109ab29ca6fa69a887d66e6bff909c.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/216_53d48b8658c8ef542a21e66bc0244156.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/216_eb667a57eddb46f975db20e4473ebddc.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/216_1e49ff6eda94676d82704aea50158171.jpg","6":"ht