	(217, 164, 100, 'TCC OGERE RESORT AND CONFERENCE CENTRE', 'tcc-ogere-resort-and-conference-centre', NULL, NULL, '<p>TCC Ogere Resort and Conference Centre’s uniqueness holds great potential value for your organisation during the course of its annual events calendar, especially for Trainings, Bootcamps, Retreats and Conferences</p><p> </p><p>Our profile of top-class corporate clientele will also interest you as the resort is fast becoming a choice destination among blue-chip companies for Team Building Retreats, Trainings, Conferences and expatriate accommodation.</p><p> </p><p>Value Added Services Include:</p><ul><li>An exclusive store to keep Seminar Materials</li><li>An administrative Office/Secretariat on site</li><li>A football Pitch</li><li>2 Lawn Tennis Courts</li><li>A Volleyball Court</li><li>A Screen Entertainment Room</li><li>A Functional Gym</li><li>An Olympic Quarter Size Swimming Pool and</li><li>A Mini Golf Course</li></ul><p><br></p>', '017001001,  09602470474,  09062224463', 'reservations@tccogere.com', NULL, NULL, _binary 0x000000000101000000D4765D09EE110D405A5C887A66B61B40, 6.92812530, 3.63375480, NULL, 'Ogun', 'Nigeria', '2019-08-30 13:30:42', NULL, NULL, NULL, '2019-08-30 12:24:45', '2019-09-10 12:28:30', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_dc36f82a7dea53699cfd8d2fe60ada4c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_8099dbb06e58c9eb1bcbca2a4d9e65a5.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_fcfd41ca29df531f0ad1a81fc93f8717.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_7591073bb31aa2860d44cceaaaf06a90.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_6a569d983df5fd7ec0fbd4d5be7ade3d.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_0400dd4ef5f03f1d6ce4485505c9107c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/217_beddc3f68b8ee930cf5989e1a5160826.jpg"]', '