	(218, 165, 100, 'Epe Resort and Spa', 'epe-resort-and-spa', NULL, NULL, '<p>Moorhouse Properties, a proudly Nigerian owned hotel group, owning and operating a variety of international and local branded hotels in Nigeria, are proud to introduce you to the es, a proudly Nigerian owned hotel group, owning and operating a variety of international and local branded hotels in Nigeria, are proud to introduce you to the <strong>Epe Resort and Spa</strong>, situated at the end of the Epe-Lekki Express Way after having left the busy city of Lagos. This luxurious retreat offers sanctuary to those who wish to rest their weary minds and rejuvenate their spirits. As it is adjacent to various lagoons and amongst a lush indigenous forest, you are sure to find an ambience that is peaceful and contented. The air and the endless clear skies invite you to relax and dream, therewith touching your soul. Within this sub-tropical paradise you will find the highest expression of exclusive hospitality where guests will enjoy world-class relaxation– <strong>Epe Resort and Spa</strong>.<strong><em>We take care of the basics!</em></strong></p>', '081 318 38014,  081 752 90343', 'reservations@eperesort.com', NULL, NULL, _binary 0x000000000101000000F2DD9C0079950F403F24D7A8E2591A40, 6.58777870, 3.94798470, NULL, 'Lagos', 'Nigeria', '2019-08-30 14:06:32', NULL, NULL, NULL, '2019-08-30 13:00:54', '2019-08-30 13:06:32', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/218_f5deb9eabb430932ccab75afeb830872.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/218_ac28c617b12d5a8cd11458d1dd6f6304.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/218_5f8c6bd6b7ec6e5a7fe1192ba2a85292.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/218_4787fe29ffbcb5b1d1cd072f78e3f5cd.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/218_efa82d57d411dbf345a82efd319d4f5b.jpg","5":"https:\\/\\/afiaanyi.com\\/