	(219, 166, 40, 'Virgin Vie Angel Limited', 'virgin-vie-angel-limited', NULL, NULL, '<p>Virgin Vie Angel Limited started in 2005 as a Trading company that has now diversified into manufacturing. It was birthed out of a need to produce world-class corporate promotional merchandise. At VVA our focus spans advertising merchandise, business promotion products, corporate gifts, hotel amenities and luxury gifts for brand projection.</p><p>We are a wholly Nigerian company offering branded merchandise solutions that deliver the UNEXPECTED.</p><p>At VVA anything is possible. Let us help you bond your customers to your brand with promotional products and executive gifts that are an integral part of your overall marketing plan. Making the most of your time is our business.</p>', '08033338484', 'virginvieangelnigeria@gmail.com', NULL, NULL, _binary 0x000000000101000000C3A453B2F7AD0B409FDD6B521BBE1940, 6.43565110, 3.45994510, NULL, 'Anambra', 'Nigeria', '2019-08-30 14:28:14', NULL, NULL, NULL, '2019-08-30 13:25:22', '2019-08-30 13:28:14', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/219_b8613622bc8e0475432f41b03166870d.jpg","0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/219_eb85405a5eb02230fe64b7eaa3d5a768.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/219_5f7c427c5f43ccdc47e71fe8ec85e488.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/219_bafe98fdb4060bb3b9b2dea5958bc521.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/219_5cbbbc1bd616e24b839419adfa0b8601.jpg"}', 'https://vvanigeria.com', NULL, '8b Kingsley Emu Street, Lekki Phase 1, Lekki Peninsula Lagos.', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/1/d/d/1/219.jpg', 0, 1, NULL, NULL, NULL, 57),
	(220, 167, 100, 'Somerset Court', 'somerset-court', NULL, NULL, '<p><strong>SOMERSET HOSPITALITY</strong> from warm caring people. At Somerset Court, you will find everything you need to make your stay memorable.</p><p>We offer the highest quality of accommodation and services with a touch of elegant intimacy that cannot be achieved in a larger setting.</p><p><br></p><p>It features the ambiance of a private residence combined with the first class facilities of an international hotel. Our view of service embodies the core value of respect, helpfulness, courtesy, sincerity and humility which has been the corner stone of the Somerset success.</p>', '08032030349, 08033003413, 08036961524', 'reservation@somersetct.com', NULL, NULL, _binary 0x00000000010100000091711AFDC3610B400017091280DC1940, 6.46533230, 3.42273710, NULL, 'Lagos', 'Nigeria', '2019-08-30 15:15:35', NULL, NULL, NULL, '2019-08-30 13:45:38', '2019-08-30 14:15:35', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_e4b8442af9cac4833372c2860e4e0a3c.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_15eba6c56c07d3e42f474405999447ff.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_8f2efb0fc3728b8b59f78c4052bf206a.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_1152469a678c4d8f916603080b16d80f.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_5bc9f292170112268b5fe67615d82b65.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_85eeef4b712bcd1b6c63ac8e2977fd91.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_6ef0ccf09252931c507a3cbe529b001b.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_814d9fcf3bf94b6699a16d791022864b.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_f3cc6aa764cb60661fbda4b7adee75b6.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/08\\/30\\/220_85f5c9fe0bcb9faab4a7762efa60370a.