	(221, 168, 100, 'Orchard Hotel Ibadan', 'orchard-hotel-ibadan', NULL, NULL, '<p>We are 40+ rooms and suites luxury hotel located in a serene and calm location in a lush clean environment all situated in Onireke GRA area of Ibadan, Oyo State, Nigeria. </p><p><br></p><p>We offer accommodation, business and conference facilities, gym, bar, close proximity to tourist sites, tourism desk and lots more.</p><p><br></p><p>Our complimentary services include: wi-fi, complimentary in room amenities, tour guide etc.</p><p><br></p><p>Our vision and mission is to be the first choice hospitality destination in the western part of Nigeria and to portray epitome of professionalism, integrity, quality and safety in the hospitality industry. </p>', '08065491050', 'orchardhotelibadan@gmail.com', NULL, NULL, _binary 0x0000000001010000006B227DA4D2090F40A6C5CF35829B1D40, 7.40186390, 3.87979630, NULL, 'Oyo', NULL, '2019-09-10 16:16:24', NULL, NULL, NULL, '2019-08-30 19:59:49', '2019-09-10 15:16:24', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_bbeb2ab55f2b570283e9646264ee54fe.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_e40a8fa92159d9a8d8eab8bd42a0bbac.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_1fdb918e68fb8c6639bf2a8ee1218ac4.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_d0bd757b1533418977e2f40d92dcc409.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_8a1f4fea98e69bbb727d726261207eb7.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_af20062422f888a68d45e9f3134dd11b.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_a21c228cfbb290f22b05a23d5e8ad42c.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/221_5dd2f163822b48b4418a32af46c04a83.jpg"}', 'http://www.orchardhotels.com.ng', NULL, 'Opposite NDLEA Office, Off Ibadan Golf Club, Onireke GRA, Link Reservation,