	(222, 169, 100, 'Sweet Spirit Hotels And Suites Mardezok Asaba', 'sweet-spirit-hotels-and-suites-mardezok-asaba', NULL, NULL, '<p>Sweet Spirit Hotel & Suites Mardezok gives you the luxury of an international standard hotel with the freedom and space of home, by offering you the flexibility of choosing individual guest rooms, connecting rooms, in room massage or a suite.</p>', '08066095335', 'reservations.mardezok@sweetspirithotels.com', NULL, NULL, _binary 0x000000000101000000A001502047AE1A40E113460E6CE81840, 6.22697470, 6.67019320, NULL, 'Delta', 'Nigeria', '2019-09-10 11:25:52', NULL, NULL, NULL, '2019-09-09 19:04:54', '2019-09-10 10:25:52', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_1ed099f6b5a587e42f60ab8847fd75f0.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_1275457c8bd83b01855212152b53c61a.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_1a942c92ec8504dc655e53e0de808543.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_9516940a008f6cb30ecbdcf4538c735a.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_5e1b86d24a9a24fb248cd23034ad1d69.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_bb573c84ff8523e5d98fd5992e55b9f5.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_2ba040e549f60e2d2c6d6345c30ebbd5.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_48ef05daeb660d14f35857cece49df0c.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_557b1bf7970a9b7382018195d38e9e45.jpg","11":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/222_674202d067be09f860ab51f47291f2f9.jpg"}', 'https://www.sweetspirithotels.com', NULL, 'Off Okpanam Road, by Midwifery Junction, Central Core Area, Asaba Delta State', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/3/6/b/e/222.jpg', 0, 1, NULL, NULL, NULL, 57),
	(223, 170, 11, 'Cartege Cinema Asaba', 'cartege-cinema-asaba', NULL, NULL, '<p>The right place for your relaxations. </p>', '09050208153', 'managers@cartegecinemas.com', NULL, NULL, _binary 0x000000000101000000CB8401F0F4BF1A40395E81E849E11840, 6.22000850, 6.68745780, NULL, 'Delta', 'Nigeria', '2019-09-10 12:03:28', NULL, NULL, NULL, '2019-09-10 10:49:32', '2019-09-10 11:03:28', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/223_bf30bca6332ade4258698f708e139bfb.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/223_86ed51378fdec65fa2d2e7a4b28af40c.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/223_7eed621d38019b69d58ddcf306bb966a.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/223_8191f07644f89632f001141eb7796888.jpg"}', 'http://cartegecinemas.com/', NULL, 'Cartege Cinema Plot 7, Phase IV, Opp. House of Assembly, Okpanam Road, GRA Phase I Asaba, Nigeria', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/6/b/e/c/223.jpg', 0, 1, NULL, NULL, NULL, 57),
	(224, 171, 100, 'The George Lagos', 'the-george-lagos', NULL, NULL, '<p>The George is an independent luxury boutique hotel located in an exclusive, high-brow residential street. The Hotel’s central location in Ikoyi makes it ideal for guests who would like to be within reach of the Central Business District, but would like to relax and refresh in a secure, tranquil and luxurious environment.</p><p>The George has rapidly established a name for itself, catering to the needs of the discerning business travellers looking for a unique and personalized hotel stay and those seeking the comfort, safety, tranquillity, and quality of a five-star hotel with superior levels of service anggd cuisine and attention to detail. The George boasts of 61 individually appointed en-suite rooms, ranging from classic rooms to penthouse suites with fittings and facilities of exceptional quality.</p><p>The George offers the discerning traveller the ideal location in which to reside in a cloistered, secure and luxurious environment, supported by modern business facilities.</p>', '+234 01466 3664', 'reservations@thegeorgelagos.com', NULL, NULL, _binary 0x0000000001010000009E531E38C27D0B40506B3FBE29D11940, 6.45426080, 3.43640560, NULL, 'Lagos', 'Nigeria', '2019-09-10 12:49:36', NULL, NULL, NULL, '2019-09-10 11:14:27', '2019-09-10 11:49:36', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_0513ebd3e868746653a369335c1352f7.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_65aadb00d1d9f2f8e2e3b4492cb3410e.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_d39cfa3984c21563b9029f7c171ed8a3.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_46dc1c0cd2130eb3dca8b7bda0b131e1.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_fb00501a1b4d34ccfd9ffc93e08ea92c.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_358859d551e6fc778c89775f2ebfc12e.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/224_b42fdf1aecd31b5a9f27c760fcff3791.jpg"}', 'https://thegeorgelagos.com/', NULL, 'The George Lagos, 30 Lugard Avenue, Ikoyi, Lagos.', NULL, NULL, 'https://afiaanyi.com/storage/brandlogos/0/b/b/1/224.jpg', 0, 1, NULL, NULL, NULL, 57),
	(225, 172, 100, 'Eko Hotel and Suites', 'eko-hotel-and-suites', NULL, NULL, '<p>Overlooking the Eko Atlantic City and Ocean, it is just a 10-minute drive to the City Centre and only 45minutes away from the Airport. Our hotel has taken important steps to live up to West Africa\'s future model in the hospitality sector.</p><p>With the best conference and banqueting facilities, tastefully furnished to a 7000-seater capacity, a world-class swimming pool, 824 excellently furnished rooms spread across 4 hotels: EKO SIGNATURE, EKO SUITES, EKO HOTEL AND EKO GARDENS, mostly with a choice of city and sea views.</p><p>We have 8 different restaurants and 7 different bars serving a range of international cuisines, amongst other facilities. The hotel is equipped with a state of the art health and fitness centre.</p><p>We have an in-house medical clinic as well. We host the best themed buffet every Friday evening where we serve specialties across the globe: Africa, Asia, America, Italy, Mexico Middle East and Mongolia amongst others.</p>', '+234 1 2772700-25', 'info@ekohotels.com', NULL, NULL, _binary 0x0000000001010000003DB25EB12B720B404DA1F31ABBB41940, 6.42649500, 3.43074740, NULL, 'Lagos', 'Nigeria', '2019-09-10 13:26:27', NULL, NULL, NULL, '2019-09-10 12:07:20', '2019-09-10 12:26:27', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/225_e53c9f54d6b93a4ea346c357c297adf0.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/225_ea8d6314c6390bc8e97a5c191e9a3e73.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/225_83a8bb6ee1ea09c9f033608c050c135c.jpg","9":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/225_70bc44510449423cadb240c8fd8cfb80.jpg","10":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/225_a49689806314b16c2a4ed21b68384e85.jpg","11":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/225_10bc99b6c5d03539ae7c1d481c0515ee.jpg","12":"https:\\/\\/afiaanyi.com\\/s