	(226, 173, 100, 'Hampton Towers & Spa', 'hampton-towers-spa', NULL, NULL, '<p>Hampton Towers & Spa is a brand new 5 Star Hotel with state of the art facilities at Okpanam Road, Asaba.</p><p>We provide quality accommodation and food to discerning leisure and business travelers. Get ready for a personalized service, offering nothing short of comfort and luxury.</p><p>At Hampton Towers & Spa, we offer our guests a wide range of tasteful Executive rooms to Presidential Suites according to their tastes and budgets, it is designed to cater to every need and necessity with 24 hours Coffee Shop.</p><p>We have Banquet halls for weddings, meetings, workshops, and conferences in various capacities up to a 1000 people respectively.</p>', '09093033333, 09092033332', 'info@hamptontowers.com', NULL, NULL, _binary 0x000000000101000000ADE93015D1AD1A40BB7207FBC0E71840, 6.22632210, 6.66974290, NULL, 'Delta', 'Nigeria', '2019-09-10 15:45:05', NULL, NULL, NULL, '2019-09-10 12:42:21', '2019-09-10 14:45:05', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_51efbcb946501ab1a21fc15f901f05ef.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_355a912cca3988c592023121540e134b.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_58afb4c346c9a3d2c4b797ba486987de.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_f3aa1d876cd9a2a47aaa22fed6123b0f.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_fd519970c648c3fc4a778e3bfd52996d.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_9f3d0f100cc7abf3a2b3515ec4506d4f.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_338e4522ae4adaae91764657819a9b32.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_50d62e444985914bc89ebe17b3e727fc.jpg","9":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/226_aaafd53c6a720af92d9a180777d2db85.jpg",