	(227, 174, 100, 'Definite Destiny Hotels', 'definite-destiny-hotels', NULL, NULL, '<h4>Definite Destiny Hotel LTD is located at both, Ikeja, Lagos State and Asaba Delta State, which is South of Nigeria. Both hotels are a short drive from the respective airports, and boasts of well furnished air conditioned rooms with free WiFi access within the premises.</h4><p><br></p>', '09030546 014, 08072819511', 'bookings@definitedestinyhotels.com', NULL, NULL, _binary 0x000000000101000000AFAA03C534F80A403731C96DA0451A40, 6.56799480, 3.37119440, NULL, 'Lagos', 'Nigeria', '2019-09-10 17:18:43', NULL, NULL, NULL, '2019-09-10 16:10:17', '2019-09-10 16:18:43', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_570bad79732646d2953abb5084ed6fea.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_7f5760c0cd9f18a0ecaa6bdcd1d28cfa.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_f285b674bc28322a9ab470a6e841175e.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_4f236305d20f735212adfd5fa20547a7.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_bc2ed300d0b908ba3b9b29b99519b4e5.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_3bdff21110b624cc88330387a4f01cc1.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_199d6943f09e492f36faa753e4cae732.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_a85a53f5bef6b0c1e6a00ad1746ddac5.jpg","10":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_6a76bc069f27a5250dda579f83d85e4d.jpg","11":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_dc7f19fb70b6a2d27f3735bcb18964db.jpg","9":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_fe95d781174be65eba930bc7dff5fe0b.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/227_50d84d7e0aec8e5448804e67e73aa5a8.jpg"}', 'http://defin