	(228, 175, 100, 'Wise Penny Suites and SPA', 'wise-penny-suites-and-spa', NULL, NULL, '<p>It is a long established fact that a visitor will be attracted to a well structured and serene environment layout. </p><p>This is the point where WISE PENNY SUITES AND SPA come in, we offer you amazing comfort in luxury as you visit our newest state of the art hotel facilities, built to satisfy you and keep you coming back.<strong><em>Wise Penny suite and spa is a place meant to give you the best of Hospitality and comfort, visit us now.</em></strong></p><p>Wisepenny Suites we give you latest music flows in our bars and restaurant, we carefully choose music that best suits your taste, think of classic, modern, rock, pop etc.we offer the best.</p><p>We have best Chef and experienced kitchen expert that serves your desired tasty meal, well prepared to standard, from African to continental dishes, get the best at Wise Penny Hotels.</p><p>Hygiene, neatness, conducive, clean healthy, these terms are not compromised in our environment, we maintain a high standard of cleanliness and Spotless terrain.</p>', '07060501319', 'info@hotelwisepennysuites.com', NULL, NULL, _binary 0x00000000010100000007D0EFFB37EF1A40AF48A70936B91840, 6.18087020, 6.73361200, NULL, 'Delta', 'Nigeria', '2019-09-10 18:42:11', NULL, NULL, NULL, '2019-09-10 16:35:12', '2019-09-10 17:42:11', NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/228_163cc3acd78a6de2bdf7c5cbf7d74173.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/228_3aa8ca58144ab58631fa952d560f8550.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/228_09fffb1776f7068687bc02caac0991bd.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/228_84ac2ca04bc64c9b6f7af687eb1d17a6.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/228_c34722a968a1edbaaec5ca24bc89ef21.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/228_07da1