	(229, 176, 100, 'Best Western Plus Elomaz Hotel Asaba', 'best-western-plus-elomaz-hotel-asaba', NULL, NULL, '<p>Welcome to Best Western Plus Elomaz Hotel, located in the city of Asaba, the capital of oil rich Delta State of Nigeria, strategically located at the western edge of the majestic River Niger. The hotel is a 4-star standard modern hotel equipped with world best facilities, well situated in the serene environment in the government core area in Asaba, Delta state.</p><p>The property is strategically located 10 minutes away from the Asaba International Airport. At Best Western Plus Elomaz, Asaba you will be wowed by the architectural design, exquisite furnishings, and the warm and friendly guest services.</p>', '08038193264, 08127656397', 'info@bestwesternelomazhotel.com', NULL, NULL, _binary 0x00000000010100000053A6E210BBC01A40C8693E9DE1D41840, 6.20789190, 6.68821360, NULL, 'Delta', 'Nigeria', '2019-09-10 19:10:03', NULL, NULL, NULL, '2019-09-10 18:01:53', '2019-09-10 18:10:27', NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_1e2ba3e8af097627f134376a3bc70123.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_557751d34d01fda84f273768fb000502.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_a27e5bdf369914743015261266961385.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_afba4adca824f787cfb49d35f406f3ae.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_1687257b9161d9649f58c5a9b87aff82.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_5faac13a35e321ec0645d8fec4ad1898.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_202231e0b3024a05c0839e8682625ad4.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_d952a046e1b2661a0cba69d9d767464a.jpg","https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/229_a2376ba62616f6a1e80a7ee567bc2790.jpg"]', 'http://bestwesternelomazhotel.co