	(230, 177, 100, 'Mgway Hotel', 'mgway-hotel', NULL, NULL, '<p>Take a tour of MG Way Hotel and experience the best hotel in Asaba. At five (5) minutes from the local airport, staying with us while travelling makes life easy. Enjoy our beautiful view, luxury furnishing, excellent service and delicious food. MG Way Hotel is the leader in quality and service, among hotels in Asaba. </p>', '07017518470, 08055077294', 'info@mgwayhotel.com', NULL, NULL, _binary 0x00000000010100000055B9F53F65C91A407A32A42F29D31840, 6.20621180, 6.69667530, NULL, 'Delta', 'Nigeria', '2019-09-10 19:22:05', NULL, NULL, NULL, '2019-09-10 18:18:40', '2019-09-10 18:22:05', NULL, '{"0":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_81daaf619ce3d8835a8a8cd1fcdf78b2.jpg","1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_17ba5c98c2c08e09e7d6b372b3a65730.jpg","2":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_d8977a4d7304fa2aa54c1b1eb0c4bd69.jpg","3":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_364d2cdfc7263d524ce2b701d467b604.jpg","6":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_2d6e44541fcfdbf08814c85002e7d2d7.jpg","7":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_608fbb02510836caa9a82d4e3f5ac386.jpg","8":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_68a8793a21a7e8d67b6abe4ec83f99a3.jpg","9":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_cf15de131b578112d2bfbe527b50ecf4.jpg","4":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_80f4f83b1e0b314ae24952aff2222998.jpg","5":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_47ba8589a52d140e025f2cb9bf858532.jpg","11":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_e4287448266e9f6344a0817cdeca9b2b.jpg","12":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/09\\/10\\/230_2133b49fada7d0b596a2c235c518b0d0.jpg","10":"https:\\/\\/a