INSERT INTO `laravel_fulltext` (`id`, `indexable_id`, `indexable_type`, `indexed_title`, `indexed_content`, `created_at`, `updated_at`) VALUES
	(1, 2, 'WebDevEtc\\BlogEtc\\Models\\BlogEtcPost', 'AFIAANYI E-BUSINESS DIRECTORY A 21ST CENTURY INNOVATION', '<p>Change is the only constant thing. It is a universal language that cuts across race, culture, vocation, profession, religion, wants and even gender. Whilst some changes are viewed as negative, others are applauded as positive. Wants are insatiable and greatly influenced by change. Human beings remain agents of change which helps in satisfying their numerous endless wants.<br />\r\n<br />\r\nIn the distant past, and even now , people have relied on information application to achieve directions in various capacities, including satisfying their wants/needs.&nbsp; In the journey of life, we can&rsquo;t underemphasize the relevance of information because the absence of it will always lead to unrealizable visions, dreams, and goals.&nbsp; When one is not informed, one is automatically deformed, they say. It is a truism.<br />\r\n<br />\r\nRealizing the undisputable need to build a channel where people can easily have unrestricted access to whatever information required for boosting theirday-to-day business activities, Business Directory ( Yellow Page) was invented.&nbsp; What is a Business Directory?&nbsp; There are numerous definitions.&nbsp; Simply put, is a website or printed listing of information which lists businesses, categorizing them by functions, locations, activities, or sizes.<br />\r\n<br />\r\nPrior to the advent of technology, Business/Telephone Directories were limited to print versions only.&nbsp; Then it was deskbound, sedentary or stationary as it was only found in homes, libraries, public offices, hospitals, etc. It was not designed to be mobile hence limited in its functions. More so, its voluminous size made it more difficult to move it from one position to another.&nbsp;&nbsp; When technology emerged disruption set in and print version of directory became anachronistic, obsolete and less desired.<br />\r\n<br />\r\nAfiaanyi E-business Directory is an answer to human quest for peripatetic or mobile information bank that will guarantee easier identification of business locations. It is a creatively designed miniature technology targeted to foster growth of business and services with the help of internet technology. Afiaanyi online platform has successfully reduced print version of business directory into miniature technology with two convenient channels; website and mobile App.&nbsp; With the mobile App downloaded on any Smartphone, you can locate and contact any business of your choice anywhere, any time with just a touch on your Smartphone and a click on your computer.<br />\r\nHow does Afiaanyi E-business Directory impact positively on your business in this 21st century? The benefits are numerous. They include;<br />\r\n<br />\r\n1. Amplification of Your Online Presence<br />\r\n2. Improving Your Local Visibility<br />\r\n3. Getting Discovered More and with ease<br />\r\n4. Strengthening Your Business Reputation<br />\r\n5. Increasing Brand Awareness<br />\r\n6. Boosting Your SEO(Search Engine Optimization)<br />\r\n7. Showing Up on Google<br />\r\n8.Increasing profitability<br />\r\n&nbsp;</p>\r\n\r\n<p>It is not how long you stay at a door that guarantees you entry, but using the right key gives you access without delay.&nbsp; Identify with Afiaanyi E-business Directory as the right key you need to enjoy business boom in this 21st century.&nbsp; Always stay with our newsletter for ageless, timeless and fresh information that will enhance your business growth and profitability.</p>', '2019-02-16 04:54:41', '2019-02-25 20:14:02');
