	(1, NULL, 2, 1, '2', 'Product Test', NULL, NULL, 0, 10, '["https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/11\\/205528e7fa20ab1a8f5e7d6c0672738a.jpg"]', '<p>Welcome to Afiaanyi. This is your first listing. Edit or delete it, then start add listings!</p><p><br></p><p class="ql-align-justify">"The buyer is entitled to a bargain. The seller is entitled to a profit. So there is a fine margin in between where the price is right. I have found this to be true to this day whether dealing in paper hats, winter underwear or hotels."</p><p class="ql-align-justify">-  <span>Conrad Hilton</span></p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 'buy', 15.00, 'NGN', _binary 0x000000000101000000D06F4EDB7525BABF01309E4143C14940, 51.61100420, -0.10213410, '[]', 'Lagos', 'NGN', NULL, '[]', NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-01-08 23:07:12', NULL, '2019-01-08 22:07:12', '2019-07-31 15:31:49', '2019-07-31 15:31:49', 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
	(2, NULL, 2, 16, '2', 'Moto G5 Plus', NULL, NULL, 0, 3, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/images\\/2019\\/02\\/11\\/205528e7fa20ab1a8f5e7d6c0672738a.jpg"}', '<p>Moto G5 Premium Budget phone, at great value</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 60000.00, 'NGN', NULL, NULL, NULL, NULL, NULL, 'Nigeria', NULL, '[]', NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-01-24 20:18:35', NULL, '2019-01-24 19:14:43', '2019-07-31 15:31:55', '2019-07-31 15:31:55', 0, 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0),
	(3, NULL, 16, 8, '2', 'Babymate 2', NULL, NULL, 0, 1, NULL, '<p class="ql-align-justify">Babymate products are a collection of healthy, safe, pure and gentle baby care products which are specially produced for babies and their delicate skin. The products are made in Nigeria by Ngobros and Company Nigeria Limited out of the desire to have high quality but affordable baby care products proudly manufactured in our country.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Our company, with a fully modern computerizes system and well equipped modern laboratory uses the latest technology and the best raw materials to ensure that the quality of our products is in adherence with the local and international quality standards.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">The Babymate disposable diapers come in two categories which are the Babymate premium diapers usually called Babymate and the Babymate Adorable diapers which is our economy brand. </p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Babymate diapers are affordable, convenient and eco-friendly. They are best in combating diaper rash because of its in-built protective barrier which keeps wetness at bay. They are made with an inner core which is highly absorbent, thus keeps moisture away from your baby’s sensitive skin and prevents leakage.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Babymate Diapers are very easy to slide on and easy to take off. They provide high quality flexible adhesive tape fasteners which make re-positioning or re-fastening the diaper very easy.</p><p class="ql-align-justify">Babymate diapers comes in three sizes Mini (3-6kg), Midi (6.1-9kg) and Maxi (9.1-13kg), which are designed to meet your baby’s need through various stages of growth.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Babymate diapers are available nationwide. We are available through telephone, email, and we welcome you at any of our branches in Nigeria.</p><p><br></p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 6500.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 0, NULL, NULL, '2019-04-28 08:11:25', '2019-04-28 08:43:40', NULL, 0, 2, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0),
	(4, NULL, 16, 8, '2', 'Babymate Adorable Eco Midi', NULL, NULL, 0, 10, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/04\\/28\\/4_69bf96ab2c1a90c7501a236518b5fa8f.jpg"]', '<p>Babymate Diapers are very easy to slide on and easy to take off. They provide high quality flexible adhesive tape fasteners which make re-positioning or re-fastening the diaper very easy.  We have  it in three sizes Mini (3-6kg), Midi (6.1-9kg) and Maxi (9.1-13kg); all designed to meet your baby’s need through various stages of growth.</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 7500.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-04-28 12:32:27', NULL, '2019-04-28 08:24:16', '2019-04-29 11:32:24', NULL, 0, 2, NULL, 0, 9.0000, NULL, NULL, NULL, NULL, NULL, 1),
	(5, NULL, 16, 8, '2', 'Babymate Adorable Eco maxi', NULL, NULL, 0, 1, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/04\\/28\\/5_de3bb49421f38412e1e49a361ec4f66c.jpg"]', '<p>Babymate Diapers are very easy to slide on and easy to take off. They provide high quality flexible adhesive tape fasteners which make re-positioning or re-fastening the diaper very easy.  We have  it in three sizes Mini (3-6kg), Midi (6.1-9kg) and Maxi (9.1-13kg); all designed to meet your baby’s need through various stages of growth.</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 7500.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-04-29 04:38:34', NULL, '2019-04-28 12:05:47', '2019-04-29 04:28:46', NULL, 0, 2, NULL, 0, 13.0000, NULL, NULL, NULL, NULL, NULL, 0),
	(6, NULL, 16, 8, '2', 'Babymate Adorable Carry pack mini', NULL, NULL, 0, 10, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/04\\/29\\/6_307df9127b9fea353f863265fccc0f69.jpg"]', '<p>Babymate Diapers are very easy to slide on and easy to take off. They provide high quality flexible adhesive tape fasteners which make re-positioning or re-fastening the diaper very easy. We have it in three sizes Mini (3-6kg), Midi (6.1-9kg) and Maxi (9.1-13kg); all designed to meet your baby’s need through various stages of growth.</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 6300.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-04-29 05:39:46', NULL, '2019-04-29 04:25:03', '2019-04-29 11:32:13', NULL, 0, 2, NULL, 0, 6.0000, NULL, NULL, NULL, NULL, NULL, 1),
	(7, NULL, 16, 8, '2', 'Babymate Adorable Carry pack maxi', NULL, NULL, 0, 10, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/04\\/29\\/7_3aa12e49550daaa20918fc394f507986.jpg"]', '<p>Babymate Diapers are very easy to slide on and easy to take off. They provide high quality flexible adhesive tape fasteners which make re-positioning or re-fastening the diaper very easy. We have it in three sizes Mini (3-6kg), Midi (6.1-9kg) and Maxi (9.1-13kg); all designed to meet your baby’s need through various stages of growth.</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 6300.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-04-29 05:37:33', NULL, '2019-04-29 04:32:04', '2019-04-29 11:31:30', NULL, 0, 2, NULL, 0, 13.0000, NULL, NULL, NULL, NULL, NULL, 0),
	(8, NULL, 1, 41, '2', 'Tiger Energy Drink', NULL, NULL, 0, 1, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/05\\/02\\/8_5911f8ed40ea1153c359cb54d511658d.jpg"]', '<p>TIGER ENERGY DRINK! Unleash the Power of Tiger with Energy Drink made with the finest ingredients to energize and refuel your body and stimulate your power of concentrate.</p><p><br></p><p>Stumbro starka! part of a culinary heritage. Unique Whiskey Recipe. Alc: 43%</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 2670.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 0, '2019-05-02 22:08:44', NULL, '2019-05-02 13:04:22', '2019-05-03 04:01:04', '2019-05-03 04:01:04', 1, 3, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0),
	(9, NULL, 16, 41, '2', 'TIGER GINGER AND GLORIA BRANDY', NULL, NULL, 0, 1, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/05\\/03\\/9_edabdd640c8ee9861fb865090ad5249a.jpg"]', '<p><strong>Gloria Brandy</strong>!working class, assertive and indomitable. Extra Smooth. Alc: 36% Vol</p><p><br></p><p><strong>Tiger Ginger</strong>! Health drink with minerals, micro-nutrients and Ginger concentrate; 250ml Non-alcoholic.</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 4165.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-05-03 04:56:31', NULL, '2019-05-03 03:54:13', '2019-05-03 04:04:16', '2019-05-03 04:04:16', 0, 3, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0),
	(10, NULL, 16, 41, '2', 'TIGER ENERGY DRINK + STUMBRO STARKA', NULL, NULL, 0, 1, '["https:\\/\\/afiaanyi.com\\/storage\\/listings\\/2019\\/05\\/04\\/10_7514db327a6ba65275bfd9e8fe9109c0.jpg"]', '<p><br></p><p>TIGER ENERGY DRINK! Unleash the Power of Tiger with Energy Drink made with the finest ingredients to energize and refuel your body and stimulate your power of concentrate.</p><p><br></p><p>Stumbro starka! part of a culinary heritage. Unique Whiskey Recipe. Alc: 43%</p>', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, 2670.00, 'NGN', NULL, NULL, NULL, NULL, 'Anambra', 'Nigeria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', 0, 1, '2019-05-04 07:04:41', NULL, '2019-05-04 06:03:23', '2019-05-04 06:30:21', NULL, 0, 3, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0),
