INSERT INTO `stores` (`id`, `user_id`, `store_category_id`, `name`, `slug`, `blurb`, `photo`, `description`, `phone`, `email`, `staff_pick`, `views_count`, `city`, `country`, `is_admin_verified`, `is_disabled`, `tags`, `tags_string`, `photos`, `created_at`, `updated_at`, `deleted_at`, `directory_id`, `city_id`, `setup_id`) VALUES
	(2, 16, NULL, 'Ngobros & Company Nigeria Ltd', 'ngobros-company-nigeria-ltd', NULL, NULL, '<p class="ql-align-justify">Babymate products are a collection of healthy, safe, pure and gentle baby care products which are specially produced for babies and their delicate skin. The products are made in Nigeria by Ngobros and Company Nigeria Limited out of the desire to have high quality but affordable baby care products proudly manufactured in our country.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Our company, with a fully modern computerizes system and well equipped modern laboratory uses the latest technology and the best raw materials to ensure that the quality of our products is in adherence with the local and international quality standards.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">The Babymate disposable diapers come in two categories which are the Babymate premium diapers usually called Babymate and the Babymate Adorable diapers which is our economy brand. </p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Babymate diapers are affordable, convenient and eco-friendly. They are best in combating diaper rash because of its in-built protective barrier which keeps wetness at bay. They are made with an inner core which is highly absorbent, thus keeps moisture away from your baby’s sensitive skin and prevents leakage.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Babymate Diapers are very easy to slide on and easy to take off. They provide high quality flexible adhesive tape fasteners which make repositioning or re-fastening the diaper very easy.</p><p class="ql-align-justify">Babymate diapers comes in three sizes Mini (3-6kg), Midi (6.1-9kg) and Maxi (9.1-13kg), which are designed to meet your baby’s need through various stages of growth.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Babymate diapers are available nationwide. We are available through telephone, email, and we welcome you at any of our branches in Nigeria.</p><p><br></p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/04\\/28\\/2_8a0da517d35f6168321f4af290e2cfc8.jpg"]', '2019-04-28 08:08:15', '2019-04-28 21:28:36', NULL, 132, NULL, NULL),
	(3, 108, NULL, 'Tiger Foods Limited', 'tiger-energy-drink-and-stumbro-starka', NULL, NULL, '<p>For more than 2 decades, Tiger Foods Limited has been very active in the distribution and marketing of Spices, Aromatic herbs, Seasonings, Dehydrated Vegetables, and Beverages in Nigeria and some West African countries. An independent family business with a genuine business value which serves a whole lot of customers that cut across fast food chains, noodles, pasta, bakery and catering industries as well as households.</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/05\\/04\\/3_ebe5872119bd5ae0d4e8928ce4f813f7.jpg"]', '2019-05-01 03:09:26', '2019-08-19 07:53:35', NULL, 116, NULL, NULL),
	(6, 65, NULL, 'Royalton Kruz International Limited', 'royalton-kruz-international-limited', NULL, NULL, '<p>Dealers in all kinds of electronics, home and office furniture, carpet rugs and also shaggy rugs.</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/07\\/16\\/6_1abb48811a74fc1dbb5d49d11fcfb3a7.jpg"]', '2019-07-16 12:15:05', '2019-08-06 09:07:59', NULL, 141, 372, NULL),
	(11, 75, NULL, 'J I Ejison International Limited', 'ejison', NULL, NULL, '<p>Sell drinks and sardines</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/02\\/11_9d5246fbb46ec61a4e097f1feb75f9f3.jpg"]', '2019-07-29 13:10:52', '2019-08-02 12:19:09', NULL, 142, 372, 82),
	(12, 90, NULL, 'Doyin Stores', 'doyin-stores', NULL, NULL, '<p>Sell phones</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-29 14:00:39', '2019-07-29 14:00:39', NULL, 152, NULL, 82),
	(15, 103, NULL, 'C. J Noble (WA) Ltd', 'c-j-noble-wa-ltd', NULL, NULL, '<p>Dealers in all kinds of Furniture and Fittings</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '{"2":"https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/02\\/15_6f782dbb81d8020dbd5dbc868be6a8bf.jpg"}', '2019-08-02 09:27:12', '2019-08-02 09:31:37', NULL, 162, 372, 57),
	(16, 84, NULL, 'Jaylin Beauty Line', 'jaylin-beauty-line', NULL, NULL, '<p>Our offers are organic skin care products, facials, micro bladding, micro shadding, professional makeup, sale of hairs and sex enhancement products</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/06\\/16_19e69dfe86dc39907d6cce5124e59cd6.jpg"]', '2019-08-06 07:20:09', '2019-08-06 07:49:30', NULL, 148, 371, 57),
	(17, 109, NULL, 'Golden Oil Ltd', 'golden-oil-ltd', NULL, NULL, '<p><strong style="color: black;"><em><u>Company Origin/ Background:</u></em></strong></p><p><span style="color: black;">Golden Oil Industries Limited is part of the Mirchandani group of companies, which has been in operation in West Africa for over 50 years with interest spanning breweries, plastics, trading, aquaculture and vegetable oil production. The group is well known for its integrity, professionalism, and commitment to world-class best practices across all the operations in which it is engaged. The company is considered a family company where many of its experienced staff of Nigerians and Indians have been part of the team for over 15 years. The continuity and determined will to improve is one of the key strengths of the company. With a 27 year history of continued innovation and best management practices, the company is primed to become one of the largest edible oil companies in West Africa in the coming years.</span></p><p><strong style="color: black;"><em><u>Areas of Focus/ specialization:</u></em></strong></p><p><span style="color: black;">The company is one of the largest vegetable oil manufacturers in the country is considered a household name throughout the vegetable oil industry. The company supply’s vegetable oil and its by-products to manufacturers in the food, soap, cosmetics, chemicals, and animal feed industries. The company is also involved in the sale of vegetable oil in jerry cans and bottles throughout the east of Nigeria, with plans to expand its distribution network throughout the west and north. With diverse products, methods of sale, an experienced management team, strategic sourcing and state of the art facilities, the company is poised to take advantage of the current short fall of vegetable oil supply and retain its position as one of the leading manufacturers in Nigeria today.</span></p><p><strong style="color: black;"><em><u>Other Info:</u></em></strong></p><p><span style="color: black;">Golden Oil Industries Ltd., has got an excellent infrastructure in terms of production machinery and equipment. We have state-of-the-art technology and advanced manufacturing equipment to meet the bulk requirements of our clients. We have well controlled quality unit and well-coordinated manufacturing unit that add incredible strength to our overall potential. </span></p><p><span style="color: black;">Some of the achievements are that it is one of the few manufacturers in Nigeria that is able to process variety of raw materials such as Soya beans, Palm Kernel and Palm oil. The company is first in the country to produce various products and encourage new innovations which are being utilized within Nigeria today. Having one of the best mayonnaise & margarine plant in Nigeria is a major advantage of the company. Not only does the company has strong brand equity for the product but it also has a profitable avenue for its stearin through margarine, a byproduct of Palm Oil that is sold at very low prices. </span></p><p><span style="color: black;"> The company launched its consumer division in 2016 under the name of </span><strong style="color: black;"><u>“SNF Foods Limited”</u></strong><span style="color: black;"> to expand its retail product range and distribution outlets that will see it move into the value added segment of the value chain. SNF Foods Limited operate in key consumer products categories like Edible Oil (</span><em style="color: black;">Activa – Pure Vegetable Oil</em><span style="color: black;">), Mayonnaise</span><em style="color: black;"> </em><span style="color: black;">(</span><em style="color: black;">Whippy – The Real Mayonnaise</em><span style="color: black;">) & Margarine</span><em style="color: black;"> </em><span style="color: black;">(</span><em style="color: black;">Golden Cup</em><span style="color: black;">). By identifying the strategic change in the market towards consumer goods, the company is in a good position to increase its profitability.         </span></p><p><span style="color: black;">We have also consistently stayed ahead of manufacturers within the country with our state-of-the art infrastructure. The company’s products are duly certified NAFDAC, NESREA, SON. We are also a member of Manufacturers Association of Nigeria (MAN). We can proudly say that we have the largest and most sophisticated integrated edible oil complex in Nigeria. We have long standing relationships with the world best machinery manufacturers in Italy, Germany, India, and Belgium. We have purchased machinery with careful due diligence and at very competitive prices, taking advantage of our long experience in this industry.</span></p><p><span style="color: black;">Name of company: Golden Oil Industries Limited</span></p><p><span style="color: black;">Date of Incorporation: 1988</span></p><p><span style="color: black;">Date of Commencement of Business: 1992</span></p><p><span style="color: black;">Current Business and when commenced: Edible Oils and Fats manufacturing in 1992</span></p><p><span style="color: black;"> </span></p><p><strong style="color: black;">Head Office:</strong></p><p><span style="color: black;">59A AdekunleFajuyi Way,</span></p><p><span style="color: black;">OppShogunle Bus Stop,</span></p><p><span style="color: black;">Near PDP office,</span></p><p><span style="color: black;">GRA –Ikeja, Lagos,</span></p><p><span style="color: black;">Nigeria</span></p><p><span style="color: black;"> </span></p><p><strong style="color: black;">Factory Address:</strong></p><p><span style="color: black;">Plot No.51A Harbour Industrial Estate</span></p><p><span style="color: black;">Off Atani Road, Pokobros Industrial Avenue,</span></p><p><span style="color: black;">Onitsha, Anambra State, Nigeria</span></p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/06\\/17_8a0ffba05a01984777161b70d19bde80.jpg"]', '2019-08-06 13:04:28', '2019-08-06 13:04:53', NULL, 167, 371, 57),
	(18, 115, NULL, 'Amatex Concept', 'amatex-concept', NULL, NULL, '<p>Manufacturers of all kinds of footwear, wigs and beads.</p>', NULL, NULL, NULL, NULL, 'Imo', NULL, NULL, NULL, NULL, NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/07\\/18_f96816377e5611290c514ce027a7c655.jpg","0":"https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/07\\/18_e25851f66ec73e37a6b88d04c12fd7ed.jpg"}', '2019-08-07 13:01:10', '2019-08-07 13:01:36', NULL, 173, 284, 57),
	(19, 98, NULL, 'Sylflora', 'sylflora', NULL, NULL, '<p>SylFlora Industry LTD differs from other tissue manufacturers already in Nigerian market for the only reason that we maintain hygiene, cleanliness and affordability at the same time, thanks to our latest machines and scrutinized production lines.We proudly produce different brands of Toilet tissue, Facial tissue, facial handkerchief and our wet wipe and diapers production lines are currently under installation. Among our registered brands are SylFlora toilet tissue, Sylflora facial tissue, SylFlora pocket handkerchief, White Flora bathroom tissue, Daily Flora toilet tissue, Golden Flora Restroom tissue, Blessed Flora Bathroom tissue, Morning Flora toilet tissue, Uncle Bruno mini box facial handkerchief etc. </p><p><br></p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/15\\/19_099cf37d5a829a89aded3f3b2b453b08.jpg"]', '2019-08-15 11:37:56', '2019-08-15 11:39:26', NULL, 157, 364, 57),
	(20, 127, NULL, 'Lynda Gemma Closet', 'lynda-gemma-closet', NULL, NULL, '<p>Dealers in all kinds of shoes, bags, wears, watches etc</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/19\\/20_ce9d3f0ff479658b027e210e97a81d06.jpg"}', '2019-08-16 04:21:45', '2019-08-19 15:13:41', NULL, 184, 355, 57),
	(22, 128, NULL, 'Kemmy and Gideon Enterprise', 'kenny-and-gideon-enterprise', NULL, NULL, '<p>Sells all kinds of female fashion wears</p>', NULL, NULL, NULL, NULL, 'Lagos', NULL, NULL, NULL, NULL, NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/17\\/22_8e1bea4abb886684ccb7eea35aaec05c.jpg"}', '2019-08-16 04:45:19', '2019-08-17 10:18:52', NULL, 185, 192, 57),
	(23, 129, NULL, 'Purity Phina', 'purity-phina', NULL, NULL, '<p>Sells all kind of Womens Hair Fascinator Hat </p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '{"1":"https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/16\\/23_a366be38ee4aa362dd46fa8b42e74f9b.jpg"}', '2019-08-16 11:26:09', '2019-08-16 11:28:07', NULL, 186, 364, 57),
	(25, 131, NULL, 'Mercy Emmanuel Apex Investment', 'mercy-emmanuel-apex-investment', NULL, NULL, '<p>Dealers in all kinds of women cloths</p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/17\\/25_5fb60c7182980b3c4a7f0b72440ff71e.jpg"]', '2019-08-17 10:02:27', '2019-08-17 10:03:34', NULL, 187, 371, 57),
	(26, 143, NULL, 'Group Enterprises Nigeria Ltd', 'group-enterprises-nigeria-ltd', NULL, NULL, '<p class="ql-align-justify"><span style="color: rgb(0, 0, 0);">Polly Foam is the brand name of Group Enterprises Nigeria Ltd. Group Enterprises Nigeria Ltd is a wholly owned Nigeria company with its head office and factory at Niger Bridgehead industrial layout Onitsha Nigeria.</span></p><p class="ql-align-justify"><span style="color: rgb(0, 0, 0);">The company was incorporated on 19th April 1978 and officially opened for manufacturing of flexible foam product in 1980 by Nigeria first Executive President Alhaji Shehu Shagari.</span></p><p><br></p><h3>SERVICES</h3><p><span style="color: rgb(0, 0, 0);">Group Enterprises Nigeria Ltd offers a variety of high quality and superior foam products for customers of all economic level. Mattresses of different grades are available. By use of the state of the art foaming machine, the company can produce varying grade/density foam during production. The needs of aged people are addressed by the company with the introduction of her orthopaedic mattresses.</span></p>', NULL, NULL, NULL, NULL, 'Anambra', NULL, NULL, NULL, NULL, NULL, '["https:\\/\\/afiaanyi.com\\/storage\\/stores\\/2019\\/08\\/23\\/26_4cd9e0f24fe4adc14cdd26a1fac41400.jpg"]', '2019-08-23 19:07:28', '2019-08-23 19:08:03', NULL, 199, 364, 57);
